INSERT INTO `datasource_table` VALUES ('0020529cd7cb330669a5d92cb19fb14d', 'oauth_client_details', 'oauth-client-details', 'd18edef4341edbf3970a4d0b823204bd', 'jvs', 1, '2021-09-24 10:58:34', NULL, '2021-09-24 10:58:34', NULL, NULL, 'CREATE TABLE `oauth_client_details` (\n  `client_id` varchar(255) NOT NULL COMMENT \'用于唯一标识每一个客户端(client)；注册时必须填写(也可以服务端自动生成)，这个字段是必须的，实际应用也有叫app_key\',\n  `resource_ids` varchar(255) DEFAULT NULL COMMENT \'客户端能访问的资源id集合，注册客户端时，根据实际需要可选择资源id，也可以根据不同的额注册流程，赋予对应的额资源id\',\n  `client_secret` varchar(255) DEFAULT NULL COMMENT \'注册填写或者服务端自动生成，实际应用也有叫app_secret, 必须要有前缀代表加密方式\',\n  `scope` varchar(255) DEFAULT NULL COMMENT \'指定client的权限范围，比如读写权限，比如移动端还是web端权限\',\n  `authorized_grant_types` varchar(255) DEFAULT NULL COMMENT \'可选值 授权码模式:authorization_code,密码模式:password,刷新token: refresh_token, 隐式模式: implicit: 客户端模式: client_credentials。支持多个用逗号分隔\',\n  `web_server_redirect_uri` varchar(255) DEFAULT NULL COMMENT \'客户端重定向uri，authorization_code和implicit需要该值进行校验，注册时填写，\',\n  `authorities` varchar(255) DEFAULT NULL COMMENT \'指定用户的权限范围，如果授权的过程需要用户登陆，该字段不生效，implicit和client_credentials需要\',\n  `access_token_validity` int(11) DEFAULT NULL COMMENT \'设置access_token的有效时间(秒),默认(60*60*12,12小时)\',\n  `refresh_token_validity` int(11) DEFAULT NULL COMMENT \'设置refresh_token有效期(秒)，默认(60*60*24*30, 30填)\',\n  `additional_information` text COMMENT \'值必须是json格式\',\n  `create_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP,\n  `archived` tinyint(1) DEFAULT \'0\',\n  `trusted` tinyint(1) DEFAULT \'0\',\n  `autoapprove` varchar(255) DEFAULT \'false\' COMMENT \'默认false,适用于authorization_code模式,设置用户是否自动approval操作,设置true跳过用户确认授权操作页面，直接跳到redirect_uri\',\n  PRIMARY KEY (`client_id`) USING BTREE\n) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT=\'oauth-client-details\'', '[]', '[]', 0);
INSERT INTO `datasource_table` VALUES ('006bd184db20286216701fc164b5be31', 'hr_pro_task', '人力资源-项目任务', 'd18edef4341edbf3970a4d0b823204bd', 'jvs', 1, '2021-09-24 10:58:33', NULL, '2021-09-24 10:58:33', NULL, NULL, 'CREATE TABLE `hr_pro_task` (\n  `id` int(11) NOT NULL COMMENT \'任务id\',\n  `name` text COMMENT \'任务名称\',\n  `status` varchar(255) DEFAULT NULL COMMENT \'任务状态\',\n  `assigned` varchar(255) DEFAULT NULL COMMENT \'指派给\',\n  `finished` varchar(255) DEFAULT NULL COMMENT \'完成者\',\n  `pre_time` double(10,4) DEFAULT NULL COMMENT \'预计耗时\',\n  `cost_time` double(10,4) DEFAULT NULL COMMENT \'消耗时间\',\n  `surplus_time` double(10,4) DEFAULT NULL COMMENT \'剩余时间\',\n  `progress` double(10,4) DEFAULT NULL COMMENT \'进度\',\n  `start_time` datetime DEFAULT NULL COMMENT \'开始时间\',\n  `end_time` datetime DEFAULT NULL COMMENT \'截至时间\',\n  `mark` text COMMENT \'任务描述\',\n  `creator` varchar(255) DEFAULT NULL COMMENT \'创建人\',\n  `create_time` datetime DEFAULT NULL COMMENT \'创建时间\',\n  `type` varchar(255) DEFAULT NULL COMMENT \'任务类型\',\n  `pro_id` int(11) DEFAULT NULL COMMENT \'所属项目\',\n  `priority_level` varchar(255) DEFAULT NULL COMMENT \'优先级\',\n  PRIMARY KEY (`id`) USING BTREE\n) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 ROW_FORMAT=DYNAMIC COMMENT=\'人力资源-项目任务\'', '[]', '[]', 0);
INSERT INTO `datasource_table` VALUES ('00f833d8f6a51423cf86950d06097419', 'risk_flow_project', '决策流管理', 'd18edef4341edbf3970a4d0b823204bd', 'jvs', 1, '2021-09-24 10:58:36', NULL, '2021-09-24 10:58:36', NULL, NULL, 'CREATE TABLE `risk_flow_project` (\n  `id` int(20) NOT NULL AUTO_INCREMENT COMMENT \'主键\',\n  `project_no` varchar(40) DEFAULT NULL COMMENT \'编号\',\n  `name` varchar(255) NOT NULL COMMENT \'项目名称\',\n  `phase` varchar(20) DEFAULT NULL COMMENT \'风控阶段(相当于备注使用，没有业务参与)\',\n  `status` tinyint(1) DEFAULT \'0\' COMMENT \'风控包状态true启用;false停用) \',\n  `test_state` tinyint(1) DEFAULT \'0\' COMMENT \'测试状态 \',\n  `create_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT \'创建时间\',\n  `update_time` datetime DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT \'修改时间\',\n  `create_by` varchar(255) DEFAULT NULL COMMENT \'创建人\',\n  `extension` json DEFAULT NULL COMMENT \'拓展字段\',\n  `remark` varchar(200) DEFAULT NULL COMMENT \'备注\',\n  `param_obj_list` json DEFAULT NULL COMMENT \'前端表达式回显渲染\',\n  `customer` varchar(255) DEFAULT NULL COMMENT \'该项目属于的客户名称\',\n  `tenant_id` int(11) DEFAULT NULL COMMENT \'租户\',\n  `strategy_type` tinyint(1) DEFAULT \'0\' COMMENT \'true   覆盖性决策,否则为漏斗形 \',\n  `del_flag` tinyint(1) DEFAULT \'0\' COMMENT \'逻辑删除 1是 0 否\',\n  `version` varchar(30) DEFAULT NULL COMMENT \'版本号\',\n  PRIMARY KEY (`id`) USING BTREE\n) ENGINE=InnoDB AUTO_INCREMENT=105 DEFAULT CHARSET=utf8mb4 COMMENT=\'决策流管理\'', '[]', '[]', 0);
INSERT INTO `datasource_table` VALUES ('03f25a1db6ba37529269ca16a8a47453', 'rule', '逻辑定义数据', 'd18edef4341edbf3970a4d0b823204bd', 'jvs', 1, '2021-09-24 10:58:38', NULL, '2021-09-24 10:58:38', NULL, NULL, 'CREATE TABLE `rule` (\n  `id` char(50) NOT NULL COMMENT \'主键\',\n  `external_enable` tinyint(1) DEFAULT NULL COMMENT \'开启外部接口调用\',\n  `secret` varchar(255) DEFAULT NULL COMMENT \'调用主键\',\n  `name` varchar(255) DEFAULT NULL COMMENT \'名称\',\n  `content` text COMMENT \'模板介绍\',\n  `enable` tinyint(255) DEFAULT \'0\' COMMENT \'是否启用\',\n  `create_by` varchar(50) DEFAULT NULL COMMENT \'创建人名称\',\n  `create_by_id` char(50) DEFAULT NULL COMMENT \'创建者ID\',\n  `create_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT \'创建时间\',\n  `update_by` varchar(50) DEFAULT NULL COMMENT \'修改人\',\n  `update_time` datetime DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT \'更新时间\',\n  `flag` tinyint(1) DEFAULT \'0\' COMMENT \'是否删除 0未删除  1已删除\',\n  `remark` varchar(255) DEFAULT NULL COMMENT \'备注\',\n  `tenant_id` char(50) DEFAULT NULL COMMENT \'租户ID\',\n  `job_id` char(50) DEFAULT NULL COMMENT \'岗位id\',\n  `dept_id` char(50) DEFAULT NULL COMMENT \'部门id\',\n  PRIMARY KEY (`id`) USING BTREE\n) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT=\'逻辑定义数据\'', '[]', '[]', 0);
