INSERT INTO `datasource_table` VALUES ('0a7469140f1525c60d6e877040b2f005', 'sys_dict', '字典表', 'd18edef4341edbf3970a4d0b823204bd', 'jvs', 1, '2021-09-24 10:58:38', NULL, '2021-09-24 10:58:38', NULL, NULL, 'CREATE TABLE `sys_dict` (\n  `id` char(50) NOT NULL COMMENT \'编号\',\n  `type` varchar(100) DEFAULT NULL,\n  `description` varchar(100) DEFAULT NULL,\n  `create_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT \'创建时间\',\n  `update_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT \'更新时间\',\n  `remarks` varchar(255) DEFAULT NULL COMMENT \'备注\',\n  `system` char(1) DEFAULT \'0\' COMMENT \'字典类型\',\n  `del_flag` char(1) DEFAULT \'0\' COMMENT \'删除状态\',\n  `tenant_id` char(50) NOT NULL DEFAULT \'0\' COMMENT \'所属租户\',\n  `create_by` varchar(40) DEFAULT NULL COMMENT \'创建人\',\n  `parent_id` char(50) DEFAULT \'-1\' COMMENT \'上级id，顶级-1\',\n  `uniq_id` varchar(64) DEFAULT NULL COMMENT \'唯一id，数据迁移用到\',\n  PRIMARY KEY (`id`) USING BTREE,\n  KEY `sys_dict_del_flag` (`del_flag`) USING BTREE\n) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT=\'字典表\'', '[{\"indexStyle\":\"NORMAL\",\"indexName\":\"sys_dict_del_flag\",\"indexFieldIdOrName\":[\"del_flag\"],\"indexComment\":\"\",\"indexType\":\"BTREE\"}]', '[]', 0);
INSERT INTO `datasource_table` VALUES ('0bdbf1c5fc17c12365de69cf3fd78a99', 'sys_contract', '合同', 'd18edef4341edbf3970a4d0b823204bd', 'jvs', 1, '2021-09-24 10:58:38', NULL, '2021-09-24 10:58:38', NULL, NULL, 'CREATE TABLE `sys_contract` (\n  `id` char(50) NOT NULL DEFAULT \'0\' COMMENT \'ID\',\n  `name` varchar(50) DEFAULT NULL COMMENT \'合同名称\',\n  `form_key` varchar(255) DEFAULT NULL COMMENT \'表单的关联key\',\n  `content` longtext COMMENT \'合同内容\',\n  `tenant_id` char(50) DEFAULT NULL COMMENT \'租户ID\',\n  `extension` json DEFAULT NULL COMMENT \'扩展字段\',\n  `update_by` varchar(100) DEFAULT NULL COMMENT \'修改人\',\n  `create_by` varchar(100) DEFAULT NULL COMMENT \'创建人\',\n  `create_time` datetime NOT NULL COMMENT \'创建时间\',\n  `business_type` tinyint(2) DEFAULT \'1\' COMMENT \'类型1-系统类型,2-自行设计\'\n) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT=\'合同\'', '[]', '[]', 0);
INSERT INTO `datasource_table` VALUES ('0fb65e403e632303e98c67aa89897bac', 'pay_notify', '租户通知表', 'd18edef4341edbf3970a4d0b823204bd', 'jvs', 1, '2021-09-24 10:58:35', NULL, '2021-09-24 10:58:35', NULL, NULL, 'CREATE TABLE `pay_notify` (\n  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT \'主键ID\',\n  `order_id` varchar(24) NOT NULL COMMENT \'支付订单ID或退款订单id\',\n  `mch_order_no` varchar(30) NOT NULL COMMENT \'租户订单号\',\n  `notify_type` varchar(8) NOT NULL COMMENT \'通知类型:1-支付,2-转账,3-退款\',\n  `notify_url` varchar(2048) DEFAULT NULL COMMENT \'通知地址\',\n  `notify_count` tinyint(6) NOT NULL DEFAULT \'0\' COMMENT \'通知次数\',\n  `result` varchar(2048) DEFAULT NULL COMMENT \'通知响应结果\',\n  `status` tinyint(6) NOT NULL DEFAULT \'1\' COMMENT \'通知状态,1-通知中,2-通知成功,3-通知失败\',\n  `last_notify_time` datetime DEFAULT NULL COMMENT \'最后一次通知时间\',\n  `create_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT \'创建时间\',\n  `update_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT \'更新时间\',\n  `del_flag` tinyint(1) DEFAULT \'0\' COMMENT \'0-正常，1-删除\',\n  `tenant_id` int(11) DEFAULT NULL COMMENT \'租户ID\',\n  PRIMARY KEY (`id`) USING BTREE,\n  UNIQUE KEY `uk_order_id` (`order_id`) USING BTREE,\n  UNIQUE KEY `uk_tenant_type_order_no` (`tenant_id`,`notify_type`,`mch_order_no`) USING BTREE\n) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT=\'租户通知表\'', '[{\"indexStyle\":\"UNIQUE\",\"indexName\":\"uk_tenant_type_order_no\",\"indexFieldIdOrName\":[\"tenant_id\",\"notify_type\",\"mch_order_no\"],\"indexComment\":\"\",\"indexType\":\"BTREE\"},{\"indexStyle\":\"UNIQUE\",\"indexName\":\"uk_order_id\",\"indexFieldIdOrName\":[\"order_id\"],\"indexComment\":\"\",\"indexType\":\"BTREE\"}]', '[]', 0);
INSERT INTO `datasource_table` VALUES ('1038f3b18311754f5357d488fdbaeee1', 'rule_log', '逻辑定义数据', 'd18edef4341edbf3970a4d0b823204bd', 'jvs', 1, '2021-09-24 10:58:38', NULL, '2021-09-24 10:58:38', NULL, NULL, 'CREATE TABLE `rule_log` (\n  `id` char(50) NOT NULL COMMENT \'主键\',\n  `run_type` enum(\'JOB\',\'TEST\',\'REAL\') DEFAULT NULL COMMENT \'环境\',\n  `req_run_key` char(50) DEFAULT NULL COMMENT \'运行key\',\n  `start_time` datetime(3) DEFAULT NULL COMMENT \'开始时间\',\n  `end_time` datetime(3) DEFAULT NULL COMMENT \'结束时间\',\n  `total_execution_time` int(255) DEFAULT \'0\' COMMENT \' 消耗时间\',\n  `flag` tinyint(1) DEFAULT \'0\' COMMENT \'是否删除 0未删除  1已删除\',\n  `variable_map` json DEFAULT NULL COMMENT \'请求参数\',\n  `result_variable_map` json DEFAULT NULL COMMENT \'执行后的参数\',\n  `status` tinyint(1) DEFAULT NULL COMMENT \'执行状态\',\n  `req_data` json DEFAULT NULL COMMENT \'请求参数\',\n  `error_msg` text COMMENT \'错误参数\',\n  `version` varchar(255) DEFAULT NULL COMMENT \'版本号\',\n  `logs` longtext COMMENT \'打印日志\',\n  `result` longtext COMMENT \'返回值\',\n  `remark` varchar(255) DEFAULT NULL COMMENT \'备注\',\n  `tenant_id` char(50) DEFAULT NULL COMMENT \'租户ID\',\n  `dept_id` char(50) DEFAULT NULL COMMENT \'部门id\',\n  PRIMARY KEY (`id`) USING BTREE\n) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT=\'逻辑定义数据\'', '[]', '[]', 0);
