INSERT INTO `datasource_table` VALUES ('16ee7bc0c7ce1ceed927dd1b8aa79352', 'sys_authority', '数据权限', 'd18edef4341edbf3970a4d0b823204bd', 'jvs', 1, '2021-09-24 10:58:38', NULL, '2021-09-24 10:58:38', NULL, NULL, 'CREATE TABLE `sys_authority` (\n  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT \'主键\',\n  `name` varchar(50) CHARACTER SET utf8mb4 DEFAULT NULL COMMENT \'名字\',\n  `tenant_id` int(11) DEFAULT \'1\' COMMENT \'租户ID默认1\',\n  `create_by` varchar(255) DEFAULT NULL COMMENT \'创建人\',\n  `create_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT \'创建时间\',\n  `post` json DEFAULT NULL COMMENT \'职位数据权限\',\n  `dept` varchar(255) DEFAULT NULL COMMENT \'部门数据权限\',\n  `annotation` varchar(255) DEFAULT NULL COMMENT \'描述\',\n  `custom` json DEFAULT NULL COMMENT \'自定义数据权限\',\n  `role` json DEFAULT NULL COMMENT \'角色数据权限\',\n  PRIMARY KEY (`id`) USING BTREE\n) ENGINE=InnoDB AUTO_INCREMENT=22 DEFAULT CHARSET=utf8 COMMENT=\'数据权限\'', '[]', '[]', 0);
INSERT INTO `datasource_table` VALUES ('1a791f8146c25be7c188555762a48118', 'page_demo_grade', '年级', 'd18edef4341edbf3970a4d0b823204bd', 'jvs', 1, '2021-09-24 10:58:34', NULL, '2021-09-24 10:58:34', NULL, NULL, 'CREATE TABLE `page_demo_grade` (\n  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT \'ID\',\n  `school_id` int(11) NOT NULL COMMENT \'校园ID\',\n  `name` varchar(255) DEFAULT NULL COMMENT \'年级名称\',\n  `person_num` int(3) DEFAULT NULL COMMENT \'总人数\',\n  `note` text COMMENT \'备注信息\',\n  `create_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT \'创建时间\',\n  `update_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT \'更新时间\',\n  `create_by` varchar(40) DEFAULT NULL COMMENT \'创建人\',\n  `update_by` varchar(40) DEFAULT NULL COMMENT \'更新人\',\n  `tenant_id` int(11) NOT NULL DEFAULT \'1\' COMMENT \'所属租户\',\n  `del_flag` char(1) DEFAULT \'0\' COMMENT \'删除状态\',\n  PRIMARY KEY (`id`) USING BTREE\n) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT=\'年级\'', '[]', '[]', 0);
INSERT INTO `datasource_table` VALUES ('1b0b1b1f70ad45f224ffccb89405f72f', 'oauth_access_token', 'oauth_access_token', 'd18edef4341edbf3970a4d0b823204bd', 'jvs', 1, '2021-09-24 10:58:33', NULL, '2021-09-24 10:58:33', NULL, NULL, 'CREATE TABLE `oauth_access_token` (\n  `create_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP,\n  `token_id` varchar(255) DEFAULT NULL,\n  `token` blob,\n  `authentication_id` varchar(255) DEFAULT NULL,\n  `user_name` varchar(255) DEFAULT NULL,\n  `client_id` varchar(255) DEFAULT NULL,\n  `authentication` blob,\n  `refresh_token` varchar(255) DEFAULT NULL,\n  KEY `token_id_index` (`token_id`) USING BTREE,\n  KEY `authentication_id_index` (`authentication_id`) USING BTREE,\n  KEY `user_name_index` (`user_name`) USING BTREE,\n  KEY `client_id_index` (`client_id`) USING BTREE,\n  KEY `refresh_token_index` (`refresh_token`) USING BTREE\n) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT=\'oauth_access_token\'', '[{\"indexStyle\":\"NORMAL\",\"indexName\":\"client_id_index\",\"indexFieldIdOrName\":[\"client_id\"],\"indexComment\":\"\",\"indexType\":\"BTREE\"},{\"indexStyle\":\"NORMAL\",\"indexName\":\"refresh_token_index\",\"indexFieldIdOrName\":[\"refresh_token\"],\"indexComment\":\"\",\"indexType\":\"BTREE\"},{\"indexStyle\":\"NORMAL\",\"indexName\":\"token_id_index\",\"indexFieldIdOrName\":[\"token_id\"],\"indexComment\":\"\",\"indexType\":\"BTREE\"},{\"indexStyle\":\"NORMAL\",\"indexName\":\"user_name_index\",\"indexFieldIdOrName\":[\"user_name\"],\"indexComment\":\"\",\"indexType\":\"BTREE\"},{\"indexStyle\":\"NORMAL\",\"indexName\":\"authentication_id_index\",\"indexFieldIdOrName\":[\"authentication_id\"],\"indexComment\":\"\",\"indexType\":\"BTREE\"}]', '[]', 0);
INSERT INTO `datasource_table` VALUES ('1e7bf427d8179d4892644a23f9e42d14', 'sys_role', '系统角色表', 'd18edef4341edbf3970a4d0b823204bd', 'jvs', 1, '2021-09-24 10:58:41', NULL, '2021-09-24 10:58:41', NULL, NULL, 'CREATE TABLE `sys_role` (\n  `id` char(50) COLLATE utf8mb4_bin NOT NULL COMMENT \'主键\',\n  `role_name` varchar(64) COLLATE utf8mb4_bin NOT NULL COMMENT \'角色名称\',\n  `role_desc` varchar(255) COLLATE utf8mb4_bin DEFAULT NULL COMMENT \'角色解释\',\n  `create_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT \'创建时间\',\n  `update_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT \'修改时间\',\n  `del_flag` tinyint(1) DEFAULT \'0\' COMMENT \'删除标识（0-正常,1-删除）\',\n  `tenant_id` char(50) COLLATE utf8mb4_bin DEFAULT \'1\' COMMENT \'租户ID默认1\',\n  `ds_type` enum(\'all\',\'oneself\',\'subordinate\',\'custom\') COLLATE utf8mb4_bin DEFAULT \'all\' COMMENT \'all:所有部门\\r\\noneself: 当前部门\\r\\nsubordinate:当前部门及以下部门\\r\\ncustom:自定义部门集使用,分割\',\n  `data_type` varchar(255) COLLATE utf8mb4_bin DEFAULT NULL COMMENT \'所有的部门数据集IDS,当ds_type为custom,时，此字段才会生效\',\n  PRIMARY KEY (`id`) USING BTREE\n) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_bin COMMENT=\'系统角色表\'', '[]', '[]', 0);
INSERT INTO `datasource_table` VALUES ('212d476b481195c6c3d2ee9b36bfbcf1', 'user', 'user', 'd18edef4341edbf3970a4d0b823204bd', 'jvs', 1, '2021-09-24 10:58:43', NULL, '2021-09-24 10:58:43', NULL, NULL, 'CREATE TABLE `user` (\n  `id` bigint(11) NOT NULL,\n  `name` varchar(30) COLLATE utf8mb4_german2_ci DEFAULT NULL,\n  `age` int(11) DEFAULT NULL,\n  `tenantid` int(11) NOT NULL,\n  PRIMARY KEY (`id`,`tenantid`) USING BTREE\n) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_german2_ci', '[]', '[]', 0);
INSERT INTO `datasource_table` VALUES ('230bf39a5e37a725d8749185a2c7521c', 'demo_test2', 'demo_test2', 'd18edef4341edbf3970a4d0b823204bd', 'jvs', 1, '2021-09-24 10:58:32', NULL, '2021-09-24 10:58:32', NULL, NULL, 'CREATE TABLE `demo_test2` (\n  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT \'id\',\n  `name` varchar(20) DEFAULT NULL COMMENT \'姓名\',\n  `age` int(3) DEFAULT NULL COMMENT \'年龄\',\n  PRIMARY KEY (`id`) USING BTREE\n) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4', '[]', '[]', 0);
INSERT INTO `datasource_table` VALUES ('241110f6046a68c7eae13e8a8276ac49', 'sys_tree', '自定义树,可以针对所有的树型结构进行处理,使用方式与字典类似', 'd18edef4341edbf3970a4d0b823204bd', 'jvs', 1, '2021-09-24 10:58:41', NULL, '2021-09-24 10:58:41', NULL, NULL, 'CREATE TABLE `sys_tree` (\n  `id` char(50) NOT NULL COMMENT \'主键\',\n  `name` varchar(50) DEFAULT NULL,\n  `parent_id` char(50) DEFAULT NULL COMMENT \'上级ID\',\n  `sort` int(10) DEFAULT NULL COMMENT \'排序\',\n  `dict_name` varchar(50) DEFAULT NULL COMMENT \'字典名称\',\n  `value` varchar(2550) DEFAULT NULL COMMENT \'显示值\',\n  `tenant_id` char(50) DEFAULT \'1\' COMMENT \'租户ID\',\n  `remarks` varchar(255) DEFAULT NULL COMMENT \'备注\',\n  `unique_name` varchar(255) DEFAULT NULL COMMENT \'UUID,该值唯一且永不改变,用作被引用时的key\',\n  PRIMARY KEY (`id`) USING BTREE\n) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT=\'自定义树,可以针对所有的树型结构进行处理,使用方式与字典类似\'', '[]', '[]', 0);
INSERT INTO `datasource_table` VALUES ('248f25fea93d8eb93c92ce54887bcf05', 'oauth_code', 'oauth-code', 'd18edef4341edbf3970a4d0b823204bd', 'jvs', 1, '2021-09-24 10:58:34', NULL, '2021-09-24 10:58:34', NULL, NULL, 'CREATE TABLE `oauth_code` (\n  `create_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP,\n  `code` varchar(255) DEFAULT NULL,\n  `authentication` blob,\n  KEY `code_index` (`code`) USING BTREE\n) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT=\'oauth-code\'', '[{\"indexStyle\":\"NORMAL\",\"indexName\":\"code_index\",\"indexFieldIdOrName\":[\"code\"],\"indexComment\":\"\",\"indexType\":\"BTREE\"}]', '[]', 0);
INSERT INTO `datasource_table` VALUES ('25a667c641b7e52697ff73c1584379b1', 'crud_page', '列表的列表配置项', 'd18edef4341edbf3970a4d0b823204bd', 'jvs', 1, '2021-09-24 10:58:29', NULL, '2021-09-24 10:58:29', NULL, NULL, 'CREATE TABLE `crud_page` (\n  `id` char(50) NOT NULL COMMENT \'主键\',\n  `name` varchar(64) NOT NULL COMMENT \'页面名称\',\n  `type` varchar(60) DEFAULT NULL COMMENT \'分类\',\n  `view_json` longtext COMMENT \'渲染json\',\n  `tenant_id` char(50) DEFAULT NULL COMMENT \'租户ID\',\n  `is_deploy` tinyint(1) DEFAULT \'0\' COMMENT \'是否已发布\',\n  `create_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT \'创建时间\',\n  `update_time` datetime DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT \'更新时间\',\n  `create_by` varchar(40) DEFAULT NULL COMMENT \'创建人\',\n  `update_by` varchar(40) DEFAULT NULL COMMENT \'更新人\',\n  `flag` char(1) DEFAULT \'0\' COMMENT \'删除状态\',\n  `code` varchar(64) DEFAULT NULL COMMENT \'唯一code\',\n  `description` varchar(64) DEFAULT NULL COMMENT \'描述\',\n  PRIMARY KEY (`id`) USING BTREE,\n  UNIQUE KEY `code` (`code`) USING BTREE\n) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT=\'列表的列表配置项\'', '[{\"indexStyle\":\"UNIQUE\",\"indexName\":\"code\",\"indexFieldIdOrName\":[\"code\"],\"indexComment\":\"\",\"indexType\":\"BTREE\"}]', '[]', 0);
INSERT INTO `datasource_table` VALUES ('27386b6c82499943ef0f67c9677442a7', 'risk_flow_line', '风控_决策流_线', 'd18edef4341edbf3970a4d0b823204bd', 'jvs', 1, '2021-09-24 10:58:36', NULL, '2021-09-24 10:58:36', NULL, NULL, 'CREATE TABLE `risk_flow_line` (\n  `id` char(50) NOT NULL COMMENT \'节点Id\',\n  `from_no` varchar(40) DEFAULT NULL COMMENT \'起始节点编号\',\n  `to_no` varchar(255) NOT NULL COMMENT \'结束节点编号\',\n  `data` json DEFAULT NULL COMMENT \'扩展字段,json格式,用于存储交互需要的数据\',\n  `project_no` varchar(255) DEFAULT NULL COMMENT \'所属决策流的编号\',\n  `tenant_id` char(50) DEFAULT NULL COMMENT \'租户\',\n  `remark` varchar(255) DEFAULT NULL COMMENT \'备注\',\n  PRIMARY KEY (`id`) USING BTREE\n) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 ROW_FORMAT=DYNAMIC COMMENT=\'风控_决策流_线\'', '[]', '[]', 0);
INSERT INTO `datasource_table` VALUES ('27c63eccfe17abd06af1a7ce40cc5e78', 'robot_certification', '机器人凭证管理', 'd18edef4341edbf3970a4d0b823204bd', 'jvs', 1, '2021-09-24 10:58:37', NULL, '2021-09-24 10:58:37', NULL, NULL, 'CREATE TABLE `robot_certification` (\n  `id` char(50) NOT NULL COMMENT \'主键\',\n  `tenant_id` char(50) DEFAULT \'1\' COMMENT \'租户ID\',\n  `del_flag` tinyint(1) NOT NULL DEFAULT \'0\' COMMENT \'逻辑删除(0-正常,1-删除)\',\n  `business_name` varchar(64) NOT NULL COMMENT \'服务名\',\n  `name` varchar(255) NOT NULL COMMENT \'自定义业务名称\',\n  `access_token` varchar(225) NOT NULL COMMENT \'凭证密钥\',\n  `authorized_ip` json DEFAULT NULL COMMENT \'授权ip组\',\n  `create_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT \'创建时间\',\n  `update_time` datetime DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT \'更新时间\',\n  `lock_flag` tinyint(1) NOT NULL DEFAULT \'0\' COMMENT \'凭证状态(0-正常,1-禁用)\',\n  PRIMARY KEY (`id`) USING BTREE,\n  UNIQUE KEY `index_secret` (`access_token`) USING BTREE COMMENT \'密钥唯一\',\n  KEY `IDX_TENANT_ID` (`tenant_id`) USING BTREE,\n  KEY `IDX_DEL_FLAG` (`del_flag`) USING BTREE\n) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT=\'机器人凭证管理\'', '[{\"indexStyle\":\"UNIQUE\",\"indexName\":\"index_secret\",\"indexFieldIdOrName\":[\"access_token\"],\"indexComment\":\"密钥唯一\",\"indexType\":\"BTREE\"}]', '[]', 0);
INSERT INTO `datasource_table` VALUES ('2900696d07c6b126e6ae2f23ae23e6c2', 'sys_file', '文件管理', 'd18edef4341edbf3970a4d0b823204bd', 'jvs', 1, '2021-09-24 10:58:39', NULL, '2021-09-24 10:58:39', NULL, NULL, 'CREATE TABLE `sys_file` (\n  `id` char(50) NOT NULL,\n  `file_name` varchar(255) DEFAULT NULL COMMENT \'文件名 \',\n  `file_type` varchar(20) DEFAULT NULL COMMENT \'文件类型\',\n  `bucket_name` varchar(255) DEFAULT NULL COMMENT \'桶名\',\n  `module` varchar(255) DEFAULT NULL COMMENT \'模块名\',\n  `status` tinyint(1) DEFAULT NULL COMMENT \'是否上传成功 \',\n  `create_time` timestamp NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT \'上传时间\',\n  `time` int(8) DEFAULT NULL COMMENT \'消耗时间\\\\毫秒\',\n  `uuid` varchar(36) DEFAULT NULL COMMENT \'UUID\',\n  `date` varchar(20) DEFAULT NULL COMMENT \'时间\',\n  `file_path` varchar(400) DEFAULT NULL COMMENT \'文件地址\',\n  `tenant_id` char(50) DEFAULT NULL COMMENT \'租户id\',\n  `size` bigint(11) DEFAULT NULL COMMENT \'文件大小 单位:字节\',\n  `remark` varchar(255) DEFAULT NULL COMMENT \'业务备注\',\n  PRIMARY KEY (`id`) USING BTREE\n) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT=\'文件管理\'', '[]', '[]', 0);
INSERT INTO `datasource_table` VALUES ('2af9798af42cda453c7aa565ceab38c3', 'yq_user', '员工表', 'd18edef4341edbf3970a4d0b823204bd', 'jvs', 1, '2021-09-24 10:58:43', NULL, '2021-09-24 10:58:43', NULL, NULL, 'CREATE TABLE `yq_user` (\n  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT \'主键\',\n  `tenant_id` int(11) DEFAULT \'1\' COMMENT \'租户ID\',\n  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT \'创建时间\',\n  `dept_id` int(11) DEFAULT NULL COMMENT \'部门ID\',\n  `create_by` varchar(64) DEFAULT NULL COMMENT \'创建人\',\n  `task_id` varchar(64) DEFAULT NULL COMMENT \'任务ID\',\n  `del_flag` tinyint(1) DEFAULT \'0\' COMMENT \'逻辑删除\',\n  `xingming` varchar(225) DEFAULT NULL COMMENT \'姓名\',\n  `gonghao` varchar(225) DEFAULT NULL COMMENT \'工号\',\n  `xingbie` enum(\'女\',\'男\') DEFAULT NULL COMMENT \'性别\',\n  `ruzhishijian` date DEFAULT NULL COMMENT \'入职时间\',\n  `lizhishijian` date DEFAULT NULL COMMENT \'离职时间\',\n  `zhuangtai` enum(\'在职\',\'离职\') DEFAULT \'在职\' COMMENT \'在职状态\',\n  PRIMARY KEY (`id`) USING BTREE,\n  KEY `IDX_TENANT_ID` (`tenant_id`) USING BTREE,\n  KEY `IDX_DEPT_ID` (`dept_id`) USING BTREE,\n  KEY `IDX_TASK_ID` (`task_id`) USING BTREE,\n  KEY `IDX_DEL_FLAG` (`del_flag`) USING BTREE\n) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 ROW_FORMAT=DYNAMIC COMMENT=\'员工表\'', '[]', '[]', 0);
INSERT INTO `datasource_table` VALUES ('2ba308fc68f177bd583ed4e70afbe4ea', 'risk_log_batch', '日志主表', 'd18edef4341edbf3970a4d0b823204bd', 'jvs', 1, '2021-09-24 10:58:36', NULL, '2021-09-24 10:58:36', NULL, NULL, 'CREATE TABLE `risk_log_batch` (\n  `id` char(50) NOT NULL COMMENT \'主键\',\n  `no` varchar(35) NOT NULL COMMENT \'流水号\',\n  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT \'开始时间\',\n  `finish_time` timestamp NULL DEFAULT NULL COMMENT \'完成时间\',\n  `consuming_time` int(11) DEFAULT NULL COMMENT \'执行时间\',\n  `application_name` varchar(50) NOT NULL COMMENT \'应用名,如果是测试数据，则为自身risk-mgr\',\n  `parameters` json DEFAULT NULL COMMENT \'入参\',\n  `passing` int(11) DEFAULT NULL COMMENT \'通过率,失败的和成功的比例\',\n  `apis` json NOT NULL COMMENT \'根据设计获取此风控调用了哪些第三方接口API\',\n  `tenant_id` char(50) DEFAULT NULL COMMENT \'租户\',\n  `remark` varchar(200) DEFAULT NULL COMMENT \'备注\',\n  `error_msg` longtext COMMENT \'错误信息,整体的错误信息\',\n  `mode` tinyint(1) NOT NULL COMMENT \'是否为正式数据，还是测试数据\',\n  `project_name` varchar(50) NOT NULL COMMENT \'决策流或决策组名称\',\n  `price_sum` int(11) DEFAULT \'0\' COMMENT \'求总价,此次接口调用后的总价格\',\n  `phase` varchar(20) DEFAULT NULL COMMENT \'风控阶段(相当于备注使用，没有业务参与)\',\n  `project_no` varchar(40) DEFAULT NULL COMMENT \'编号\',\n  `count` int(11) DEFAULT NULL COMMENT \'总条数\',\n  `project_strategy` tinyint(1) DEFAULT NULL COMMENT \'决策类型  1 覆盖型, 0 漏斗型\',\n  `log_type` enum(\'STRATEGY_GROUP\',\'STRATEGY_FLOW\') DEFAULT \'STRATEGY_GROUP\' COMMENT \'日志类型  风控决策组日志,风控决策流日志\',\n  `project_version` varchar(255) DEFAULT NULL COMMENT \'决策流版本\',\n  PRIMARY KEY (`id`) USING BTREE,\n  UNIQUE KEY `no` (`no`) USING BTREE\n) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT=\'日志主表\'', '[{\"indexStyle\":\"UNIQUE\",\"indexName\":\"no\",\"indexFieldIdOrName\":[\"no\"],\"indexComment\":\"\",\"indexType\":\"BTREE\"}]', '[]', 0);
INSERT INTO `datasource_table` VALUES ('2c9447f20fa6a708ab0f605090061b11', 'br_module', '百融模块配置表', 'd18edef4341edbf3970a4d0b823204bd', 'jvs', 1, '2021-09-24 10:58:27', NULL, '2021-09-24 10:58:27', NULL, NULL, 'CREATE TABLE `br_module` (\n  `id` char(50) COLLATE utf8_bin NOT NULL,\n  `br_module` varchar(30) COLLATE utf8_bin NOT NULL COMMENT \'百融模块\',\n  `br_version` varchar(10) COLLATE utf8_bin DEFAULT NULL COMMENT \'模块版本\',\n  `product_name` varchar(50) COLLATE utf8_bin DEFAULT NULL COMMENT \'产品名\',\n  `strategy_id` varchar(50) COLLATE utf8_bin NOT NULL COMMENT \'策略编号\',\n  `config_id` bigint(50) NOT NULL COMMENT \'账号ID\',\n  `apiname` varchar(20) COLLATE utf8_bin DEFAULT NULL COMMENT \'apiname\',\n  `tenant_id` char(50) COLLATE utf8_bin NOT NULL COMMENT \'租户id\',\n  PRIMARY KEY (`id`) USING BTREE\n) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin COMMENT=\'百融模块配置表\'', '[]', '[]', 0);
INSERT INTO `datasource_table` VALUES ('327e36a26eddd88f8e5ca99fecea3c77', 'risk_flow_node', '风控_决策流_节点', 'd18edef4341edbf3970a4d0b823204bd', 'jvs', 1, '2021-09-24 10:58:36', NULL, '2021-09-24 10:58:36', NULL, NULL, 'CREATE TABLE `risk_flow_node` (\n  `id` char(50) NOT NULL DEFAULT \'0\' COMMENT \'节点Id\',\n  `no` varchar(40) DEFAULT NULL COMMENT \'节点编号\',\n  `name` varchar(255) NOT NULL COMMENT \'节点名称\',\n  `type` enum(\'START\',\'STRATEGY\',\'JUDGE\',\'VARIABLE\',\'END\') DEFAULT NULL COMMENT \'节点类型\',\n  `data` json DEFAULT NULL COMMENT \'扩展字段,json格式,用于存储节点上的值\',\n  `project_no` varchar(255) DEFAULT NULL COMMENT \'所属决策流的编号\',\n  `tenant_id` char(50) DEFAULT NULL COMMENT \'租户\',\n  `remark` varchar(255) DEFAULT NULL COMMENT \'备注\',\n  PRIMARY KEY (`id`) USING BTREE\n) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 ROW_FORMAT=DYNAMIC COMMENT=\'风控_决策流_节点\'', '[]', '[]', 0);
INSERT INTO `datasource_table` VALUES ('330fbf81f20bdfbd1ecc4e546cc50080', 'sys_user_group', '用户组', 'd18edef4341edbf3970a4d0b823204bd', 'jvs', 1, '2021-09-24 10:58:42', NULL, '2021-09-24 10:58:42', NULL, NULL, 'CREATE TABLE `sys_user_group` (\n  `id` char(50) COLLATE utf8mb4_bin NOT NULL COMMENT \'主键ID\',\n  `name` varchar(50) COLLATE utf8mb4_bin DEFAULT NULL COMMENT \'用户组名称\',\n  `users` json DEFAULT NULL COMMENT \'用户数组对象\',\n  `create_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT \'创建时间\',\n  `create_by` char(50) COLLATE utf8mb4_bin DEFAULT NULL COMMENT \'创建人\',\n  `tenant_id` char(50) COLLATE utf8mb4_bin DEFAULT NULL COMMENT \'租户ID\',\n  PRIMARY KEY (`id`) USING BTREE\n) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_bin COMMENT=\'用户组\'', '[]', '[]', 0);
INSERT INTO `datasource_table` VALUES ('3365179541febe009a93f0b9ac43114c', 'branch_table', 'seata-branch-table', 'd18edef4341edbf3970a4d0b823204bd', 'jvs', 1, '2021-09-24 10:58:27', NULL, '2021-09-24 10:58:27', NULL, NULL, 'CREATE TABLE `branch_table` (\n  `branch_id` bigint(20) NOT NULL,\n  `xid` varchar(128) NOT NULL,\n  `transaction_id` bigint(20) DEFAULT NULL,\n  `resource_group_id` varchar(32) DEFAULT NULL,\n  `resource_id` varchar(256) DEFAULT NULL,\n  `branch_type` varchar(8) DEFAULT NULL,\n  `status` tinyint(4) DEFAULT NULL,\n  `client_id` varchar(64) DEFAULT NULL,\n  `application_data` varchar(2000) DEFAULT NULL,\n  `gmt_create` datetime(6) DEFAULT NULL,\n  `gmt_modified` datetime(6) DEFAULT NULL,\n  PRIMARY KEY (`branch_id`) USING BTREE,\n  KEY `idx_xid` (`xid`) USING BTREE\n) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT=\'seata-branch-table\'', '[{\"indexStyle\":\"NORMAL\",\"indexName\":\"idx_xid\",\"indexFieldIdOrName\":[\"xid\"],\"indexComment\":\"\",\"indexType\":\"BTREE\"}]', '[]', 0);
INSERT INTO `datasource_table` VALUES ('344ee03789e21f94884cb9187bf48265', 'im_chat_message', '私聊全量消息表', 'd18edef4341edbf3970a4d0b823204bd', 'jvs', 1, '2021-09-24 10:58:33', NULL, '2021-09-24 10:58:33', NULL, NULL, 'CREATE TABLE `im_chat_message` (\n  `id` char(50) COLLATE utf8mb4_bin NOT NULL COMMENT \'主键ID\',\n  `from_user_id` char(50) COLLATE utf8mb4_bin NOT NULL COMMENT \'发送消息用户id\',\n  `to_user_id` char(50) COLLATE utf8mb4_bin NOT NULL COMMENT \'接收消息用户id\',\n  `message` json NOT NULL COMMENT \'聊天消息体\',\n  `create_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT \'创建时间\',\n  `update_time` timestamp NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT \'修改时间\',\n  `del_flag` tinyint(1) DEFAULT \'0\' COMMENT \'0-正常，1-删除\',\n  `tenant_id` char(50) COLLATE utf8mb4_bin DEFAULT NULL COMMENT \'租户ID\',\n  PRIMARY KEY (`id`) USING BTREE,\n  KEY `idx_to_user_id` (`to_user_id`) USING BTREE,\n  KEY `idx_from_user_id` (`from_user_id`) USING BTREE,\n  KEY `idx_tenant_id` (`tenant_id`) USING BTREE\n) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_bin COMMENT=\'私聊全量消息表\'', '[{\"indexStyle\":\"NORMAL\",\"indexName\":\"idx_to_user_id\",\"indexFieldIdOrName\":[\"to_user_id\"],\"indexComment\":\"\",\"indexType\":\"BTREE\"},{\"indexStyle\":\"NORMAL\",\"indexName\":\"idx_from_user_id\",\"indexFieldIdOrName\":[\"from_user_id\"],\"indexComment\":\"\",\"indexType\":\"BTREE\"},{\"indexStyle\":\"NORMAL\",\"indexName\":\"idx_tenant_id\",\"indexFieldIdOrName\":[\"tenant_id\"],\"indexComment\":\"\",\"indexType\":\"BTREE\"}]', '[]', 0);
INSERT INTO `datasource_table` VALUES ('357a3a7015b90dbca728e990d5446664', 'sys_regexp', '正则表达式,用于在数据表设计时，可以动态修改的模块', 'd18edef4341edbf3970a4d0b823204bd', 'jvs', 1, '2021-09-24 10:58:40', NULL, '2021-09-24 10:58:40', NULL, NULL, 'CREATE TABLE `sys_regexp` (\n  `id` char(50) NOT NULL COMMENT \'ID\',\n  `tenant_id` char(50) DEFAULT \'1\' COMMENT \'租户ID默认1\',\n  `name` varchar(50) DEFAULT NULL COMMENT \'正则名称\',\n  `expression` varchar(255) DEFAULT NULL COMMENT \'正则表达式\',\n  `type` varchar(50) DEFAULT NULL COMMENT \'类型\',\n  `remarks` varchar(255) DEFAULT NULL COMMENT \'备注\',\n  `unique_name` varchar(255) DEFAULT NULL COMMENT \'UUID,该值唯一且永不改变,用作被引用时的key\',\n  PRIMARY KEY (`id`) USING BTREE\n) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT=\'正则表达式,用于在数据表设计时，可以动态修改的模块\'', '[]', '[]', 0);
INSERT INTO `datasource_table` VALUES ('397f6ae463b3fd3cca892f3b8dbc03c8', 'hr_daily', '人力资源-日报', 'd18edef4341edbf3970a4d0b823204bd', 'jvs', 1, '2021-09-24 10:58:32', NULL, '2021-09-24 10:58:32', NULL, NULL, 'CREATE TABLE `hr_daily` (\n  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT \'id\',\n  `project_id` int(11) DEFAULT NULL COMMENT \'项目\',\n  `cost_time` double(10,4) DEFAULT NULL COMMENT \'消耗时间\',\n  `creator` varchar(255) DEFAULT NULL COMMENT \'发起人\',\n  `content` text COMMENT \'工作内容\',\n  `create_time` datetime DEFAULT NULL COMMENT \'创建时间\',\n  `type` varchar(255) DEFAULT NULL COMMENT \'任务类型\',\n  PRIMARY KEY (`id`) USING BTREE\n) ENGINE=InnoDB AUTO_INCREMENT=20 DEFAULT CHARSET=utf8mb4 ROW_FORMAT=DYNAMIC COMMENT=\'人力资源-日报\'', '[]', '[]', 0);
INSERT INTO `datasource_table` VALUES ('3e010887d7e62ecfbb852c9fac79b3b0', 'gateway_log', '接口网关调用日志', 'd18edef4341edbf3970a4d0b823204bd', 'jvs', 1, '2021-09-24 10:58:32', NULL, '2021-09-24 10:58:32', NULL, NULL, 'CREATE TABLE `gateway_log` (\n  `id` char(50) NOT NULL COMMENT \'主键\',\n  `md5` varchar(32) DEFAULT NULL COMMENT \'MD5值,查询条件的MD5加密串\',\n  `api_name` varchar(200) DEFAULT NULL COMMENT \'调用第三方的接口\',\n  `short_name` varchar(100) DEFAULT NULL COMMENT \'系统名简称 ，用于保存唯一处理，\',\n  `application_name` varchar(50) DEFAULT NULL COMMENT \'应用名\',\n  `create_time` datetime DEFAULT NULL COMMENT \'开始时间\',\n  `finish_time` datetime DEFAULT NULL COMMENT \'完成时间\',\n  `hit_cache` tinyint(1) DEFAULT NULL COMMENT \'是否命中缓存\',\n  `request_data` json DEFAULT NULL COMMENT \'请求数据\',\n  `return_data` json DEFAULT NULL COMMENT \'返回数据\',\n  `status` tinyint(1) DEFAULT NULL COMMENT \'是否正常返回\',\n  `error_msg` longtext COMMENT \'错误信息\',\n  `group_no` bigint(20) DEFAULT NULL COMMENT \'业务失败后此流水号不变\',\n  `no` bigint(20) DEFAULT NULL COMMENT \'请求流水号，如果走缓存，流水号为空\',\n  `tenant_id` char(50) DEFAULT NULL COMMENT \'租户\',\n  PRIMARY KEY (`id`) USING BTREE,\n  UNIQUE KEY `no` (`no`,`tenant_id`) USING BTREE\n) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT=\'接口网关调用日志\'', '[{\"indexStyle\":\"UNIQUE\",\"indexName\":\"no\",\"indexFieldIdOrName\":[\"no\",\"tenant_id\"],\"indexComment\":\"\",\"indexType\":\"BTREE\"}]', '[]', 0);
INSERT INTO `datasource_table` VALUES ('42b12f5338866300c15a70e7cebb2565', 'hr_pro_info', '人力资源-项目信息', 'd18edef4341edbf3970a4d0b823204bd', 'jvs', 1, '2021-09-24 10:58:32', NULL, '2021-09-24 10:58:32', NULL, NULL, 'CREATE TABLE `hr_pro_info` (\n  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT \'项目id\',\n  `name` varchar(255) DEFAULT NULL COMMENT \'项目名称\',\n  `start_time` datetime DEFAULT NULL COMMENT \'开始时间\',\n  `end_time` datetime DEFAULT NULL COMMENT \'截至时间\',\n  `status` varchar(255) DEFAULT NULL COMMENT \'状态\',\n  `cost_time` double(10,4) DEFAULT NULL COMMENT \'消耗时间\',\n  `pre_time` double(10,4) DEFAULT NULL COMMENT \'预计时间\',\n  `surplus_time` double(10,4) DEFAULT NULL COMMENT \'剩余时间\',\n  `progress` double(10,4) DEFAULT NULL COMMENT \'进度\',\n  `pro_no` varchar(64) DEFAULT NULL COMMENT \'项目编号\',\n  `pro_axure` varchar(255) DEFAULT NULL COMMENT \'项目原型\',\n  `pro_type` varchar(255) DEFAULT NULL COMMENT \'项目类型\',\n  `pro_desc` text COMMENT \'项目简介\',\n  `createor` varchar(255) DEFAULT NULL COMMENT \'发起人\',\n  `create_time` datetime DEFAULT NULL COMMENT \'创建时间\',\n  PRIMARY KEY (`id`) USING BTREE\n) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 ROW_FORMAT=DYNAMIC COMMENT=\'人力资源-项目信息\'', '[]', '[]', 0);
INSERT INTO `datasource_table` VALUES ('438cbd31fe92b5600a2689944d01153f', 'pay_order', '支付订单表', 'd18edef4341edbf3970a4d0b823204bd', 'jvs', 1, '2021-09-24 10:58:35', NULL, '2021-09-24 10:58:35', NULL, NULL, 'CREATE TABLE `pay_order` (\n  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT \'主键ID\',\n  `pay_order_id` varchar(30) NOT NULL COMMENT \'支付订单号\',\n  `mch_order_no` varchar(30) NOT NULL COMMENT \'租户订单号\',\n  `channel_id` varchar(24) NOT NULL COMMENT \'渠道ID\',\n  `amount` bigint(20) NOT NULL COMMENT \'支付金额,单位分\',\n  `currency` varchar(3) NOT NULL DEFAULT \'cny\' COMMENT \'三位货币代码,人民币:cny\',\n  `status` tinyint(6) NOT NULL DEFAULT \'0\' COMMENT \'支付状态,0-订单生成,1-支付中(目前未使用),2-支付成功,3-业务处理完成\',\n  `client_ip` varchar(32) DEFAULT NULL COMMENT \'客户端IP\',\n  `device` varchar(64) DEFAULT NULL COMMENT \'设备\',\n  `subject` varchar(64) NOT NULL COMMENT \'商品标题\',\n  `body` varchar(256) NOT NULL COMMENT \'商品描述信息\',\n  `extra` varchar(512) DEFAULT NULL COMMENT \'特定渠道发起时额外参数\',\n  `channel_mch_id` varchar(32) NOT NULL COMMENT \'渠道商户ID\',\n  `channel_order_no` varchar(64) DEFAULT NULL COMMENT \'渠道订单号\',\n  `err_code` varchar(64) DEFAULT NULL COMMENT \'渠道支付错误码\',\n  `err_msg` varchar(128) DEFAULT NULL COMMENT \'渠道支付错误描述\',\n  `param1` varchar(64) DEFAULT NULL COMMENT \'扩展参数1\',\n  `param2` varchar(64) DEFAULT NULL COMMENT \'扩展参数2\',\n  `notify_url` varchar(128) DEFAULT NULL COMMENT \'通知地址\',\n  `expire_time` bigint(20) DEFAULT NULL COMMENT \'订单失效时间\',\n  `pay_succ_time` bigint(20) DEFAULT NULL COMMENT \'订单支付成功时间\',\n  `last_notify_time` bigint(20) DEFAULT NULL COMMENT \'最后一次通知时间\',\n  `notify_count` tinyint(6) NOT NULL DEFAULT \'0\' COMMENT \'通知次数\',\n  `create_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT \'创建时间\',\n  `update_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT \'更新时间\',\n  `del_flag` tinyint(1) DEFAULT \'0\' COMMENT \'0-正常，1-删除\',\n  `tenant_id` int(11) DEFAULT NULL COMMENT \'租户ID\',\n  PRIMARY KEY (`id`) USING BTREE,\n  UNIQUE KEY `uk_pay_order_id` (`pay_order_id`) USING BTREE,\n  UNIQUE KEY `uk_tenant_id_mch_order_no` (`tenant_id`,`mch_order_no`) USING BTREE\n) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT=\'支付订单表\'', '[{\"indexStyle\":\"UNIQUE\",\"indexName\":\"uk_tenant_id_mch_order_no\",\"indexFieldIdOrName\":[\"tenant_id\",\"mch_order_no\"],\"indexComment\":\"\",\"indexType\":\"BTREE\"},{\"indexStyle\":\"UNIQUE\",\"indexName\":\"uk_pay_order_id\",\"indexFieldIdOrName\":[\"pay_order_id\"],\"indexComment\":\"\",\"indexType\":\"BTREE\"}]', '[]', 0);
INSERT INTO `datasource_table` VALUES ('46d0b71690f93c95148a4f0cb6d14be8', 'hr_weekly', '人力资源-周报', 'd18edef4341edbf3970a4d0b823204bd', 'jvs', 1, '2021-09-24 10:58:33', NULL, '2021-09-24 10:58:33', NULL, NULL, 'CREATE TABLE `hr_weekly` (\n  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT \'id\',\n  `project_id` int(11) DEFAULT NULL COMMENT \'项目id\',\n  `project_status` varchar(255) DEFAULT NULL COMMENT \'项目状态\',\n  `project_progress` varchar(255) DEFAULT NULL COMMENT \'项目进度\',\n  `personnel_progress` varchar(255) DEFAULT NULL COMMENT \'人员进度\',\n  `leader` varchar(255) DEFAULT NULL COMMENT \'负责人\',\n  `content` text COMMENT \'本周总结\',\n  `next_content` text COMMENT \'下周计划\',\n  `create_time` datetime DEFAULT NULL COMMENT \'创建时间\',\n  PRIMARY KEY (`id`) USING BTREE\n) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=utf8mb4 ROW_FORMAT=DYNAMIC COMMENT=\'人力资源-周报\'', '[]', '[]', 0);
INSERT INTO `datasource_table` VALUES ('4887bfa73e6baefaea54e73392cccf5b', 'sys_tenant', '公司租户管理', 'd18edef4341edbf3970a4d0b823204bd', 'jvs', 1, '2021-09-24 10:58:41', NULL, '2021-09-24 10:58:41', NULL, NULL, 'CREATE TABLE `sys_tenant` (\n  `id` char(50) NOT NULL COMMENT \'公司ID\',\n  `name` varchar(80) NOT NULL COMMENT \'公司全称\',\n  `short_name` varchar(20) NOT NULL COMMENT \'系统名称\',\n  `phone` varchar(15) NOT NULL COMMENT \'手机\',\n  `addr` varchar(500) DEFAULT NULL COMMENT \'公司地址\',\n  `desc_msg` varchar(500) DEFAULT NULL COMMENT \'公司简介\',\n  `update_time` datetime NOT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT \'修改时间\',\n  `create_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT \'创建时间\',\n  `del_flag` char(1) NOT NULL DEFAULT \'0\' COMMENT \'是否删除  -1：已删除  0：正常\',\n  `login_type` text NOT NULL COMMENT \'登录方式\',\n  `admin` varchar(64) NOT NULL COMMENT \'管理员\',\n  `password` varchar(255) NOT NULL COMMENT \'管理员登录密码\',\n  `login_domain` varchar(255) DEFAULT NULL COMMENT \'登录域名\',\n  `enable` tinyint(1) NOT NULL DEFAULT \'1\' COMMENT \'是否启用 1启用 0禁用\',\n  `icon` longtext COMMENT \'icon\',\n  `logo` longtext COMMENT \'logo\',\n  `bg_img` longtext COMMENT \'背景图\',\n  `template_id` varchar(64) DEFAULT NULL COMMENT \'模板id\',\n  `app_id` varchar(255) DEFAULT NULL COMMENT \'微信登录appId\',\n  `secret` varchar(255) DEFAULT NULL COMMENT \'微信登录appId\',\n  `tenant_id` char(50) DEFAULT NULL COMMENT \'租户id\',\n  `init_menu_ids` text COMMENT \'租户初始菜单\',\n  `superior_tenant_id` char(50) NOT NULL COMMENT \'上级租户id,如果是顶级租户，该值和顶级租户的id一样\',\n  `default_index_url` varchar(999) DEFAULT NULL COMMENT \'租户默认首页\',\n  `theme_style` longtext COMMENT \'主题风格\',\n  `user_default_password` varchar(255) DEFAULT \'123456\' COMMENT \'租户下的用户默认密码\',\n  `app_config` json DEFAULT NULL COMMENT \'三方服务的秘钥配置等 相关信息\',\n  PRIMARY KEY (`id`) USING BTREE,\n  KEY `name` (`name`) USING BTREE\n) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT=\'公司租户管理\'', '[{\"indexStyle\":\"NORMAL\",\"indexName\":\"name\",\"indexFieldIdOrName\":[\"name\"],\"indexComment\":\"\",\"indexType\":\"BTREE\"}]', '[]', 0);
INSERT INTO `datasource_table` VALUES ('4978cde79714475c204473836f7cdc2f', 'datasource_database', '数据源配置项', 'd18edef4341edbf3970a4d0b823204bd', 'jvs', 1, '2021-09-24 10:58:29', NULL, '2021-09-24 10:58:29', NULL, NULL, 'CREATE TABLE `datasource_database` (\n  `id` char(50) NOT NULL COMMENT \'主键\',\n  `name` varchar(50) NOT NULL COMMENT \'名称\',\n  `port` varchar(20) DEFAULT NULL COMMENT \'端口\',\n  `ip` varchar(20) DEFAULT NULL COMMENT \'主机\',\n  `database_name` varchar(50) NOT NULL COMMENT \'库名\',\n  `user_name` varchar(50) NOT NULL COMMENT \'用户名\',\n  `pass_word` varchar(50) NOT NULL COMMENT \'密码\',\n  `create_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT \'创建时间\',\n  `create_by` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL COMMENT \'创建人\',\n  `update_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT \'修改时间\',\n  `update_by` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL COMMENT \'修改人\',\n  `tenant_id` char(50) DEFAULT NULL COMMENT \'租户\',\n  PRIMARY KEY (`id`) USING BTREE,\n  UNIQUE KEY `UNIQ_DB` (`database_name`,`tenant_id`) USING BTREE,\n  KEY `name` (`name`) USING BTREE\n) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT=\'数据源配置项\'', '[{\"indexStyle\":\"NORMAL\",\"indexName\":\"name\",\"indexFieldIdOrName\":[\"name\"],\"indexComment\":\"\",\"indexType\":\"BTREE\"},{\"indexStyle\":\"UNIQUE\",\"indexName\":\"UNIQ_DB\",\"indexFieldIdOrName\":[\"database_name\",\"tenant_id\"],\"indexComment\":\"\",\"indexType\":\"BTREE\"}]', '[]', 0);
INSERT INTO `datasource_table` VALUES ('4b95de3f106a2926b3dcc05ea6bf4496', 'sys_config', '字典表', 'd18edef4341edbf3970a4d0b823204bd', 'jvs', 1, '2021-09-24 10:58:38', NULL, '2021-09-24 10:58:38', NULL, NULL, 'CREATE TABLE `sys_config` (\n  `id` char(50) NOT NULL COMMENT \'id\',\n  `project_name` varchar(500) DEFAULT NULL COMMENT \'项目名\',\n  `config_key` varchar(500) DEFAULT NULL COMMENT \'配置key\',\n  `config_value` longtext COMMENT \'配置值\',\n  `create_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT \'创建时间\',\n  `update_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT \'更新时间\',\n  `remarks` varchar(255) DEFAULT NULL COMMENT \'备注\',\n  `create_by` varchar(40) DEFAULT NULL COMMENT \'创建人\',\n  `del_flag` tinyint(1) DEFAULT \'0\' COMMENT \'逻辑删除\',\n  `tenant_id` char(50) NOT NULL DEFAULT \'0\' COMMENT \'所属租户\',\n  `create_by_id` char(50) DEFAULT NULL COMMENT \'创建人Id\',\n  `type` varchar(100) DEFAULT NULL COMMENT \'配置类型 [FILE/NUMBER/STRING]\',\n  PRIMARY KEY (`id`) USING BTREE,\n  KEY `sys_dict_del_flag` (`del_flag`) USING BTREE\n) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT=\'字典表\'', '[{\"indexStyle\":\"NORMAL\",\"indexName\":\"sys_dict_del_flag\",\"indexFieldIdOrName\":[\"del_flag\"],\"indexComment\":\"\",\"indexType\":\"BTREE\"}]', '[]', 0);
INSERT INTO `datasource_table` VALUES ('4d0d6cd0f02643c37989f0982c055d63', 'bss_mgr', 'bss官网首页信息配置管理', 'd18edef4341edbf3970a4d0b823204bd', 'jvs', 1, '2021-09-24 10:58:28', NULL, '2021-09-24 10:58:28', NULL, NULL, 'CREATE TABLE `bss_mgr` (\n  `id` char(50) NOT NULL COMMENT \'主键\',\n  `name` varchar(255) DEFAULT NULL COMMENT \'属性名\',\n  `value` text COMMENT \'属性值\',\n  PRIMARY KEY (`id`) USING BTREE\n) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT=\'bss官网首页信息配置管理\'', '[]', '[]', 0);
INSERT INTO `datasource_table` VALUES ('4ed4de2b2b026b13c301001d198bc7be', 'dc_library_like', '知识库-点赞表', 'd18edef4341edbf3970a4d0b823204bd', 'jvs', 1, '2021-09-24 10:58:30', NULL, '2021-09-24 10:58:30', NULL, NULL, 'CREATE TABLE `dc_library_like` (\n  `id` char(50) COLLATE utf8mb4_bin NOT NULL COMMENT \'主键ID\',\n  `user_id` char(50) COLLATE utf8mb4_bin NOT NULL COMMENT \'用户ID\',\n  `user_name` varchar(64) COLLATE utf8mb4_bin DEFAULT NULL COMMENT \'用户名\',\n  `biz_type` enum(\'LIBRARY\',\'COMMENT\') COLLATE utf8mb4_bin NOT NULL COMMENT \'业务类型。LIBRARY-知识库，COMMENT-评论\',\n  `biz_resource_id` char(50) COLLATE utf8mb4_bin NOT NULL COMMENT \'点赞资源id\',\n  `create_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT \'创建时间\',\n  `update_time` timestamp NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT \'修改时间\',\n  `del_flag` tinyint(1) DEFAULT \'0\' COMMENT \'0-正常，1-删除\',\n  `tenant_id` char(50) COLLATE utf8mb4_bin DEFAULT NULL COMMENT \'租户ID\',\n  PRIMARY KEY (`id`) USING BTREE,\n  KEY `idx_resource` (`biz_resource_id`) USING BTREE\n) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_bin ROW_FORMAT=DYNAMIC COMMENT=\'知识库-点赞表\'', '[{\"indexStyle\":\"NORMAL\",\"indexName\":\"idx_resource\",\"indexFieldIdOrName\":[\"biz_resource_id\"],\"indexComment\":\"\",\"indexType\":\"BTREE\"}]', '[]', 0);
