INSERT INTO `datasource_table` VALUES ('54a2a3e161c8e9f2fe0db88fa079afdf', 'pay_trans_order', '转账订单表', 'd18edef4341edbf3970a4d0b823204bd', 'jvs', 1, '2021-09-24 10:58:35', NULL, '2021-09-24 10:58:35', NULL, NULL, 'CREATE TABLE `pay_trans_order` (\n  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT \'主键ID\',\n  `trans_order_id` varchar(30) NOT NULL COMMENT \'转账订单号\',\n  `mch_trans_no` varchar(30) NOT NULL COMMENT \'租户转账单号\',\n  `channel_id` varchar(24) NOT NULL COMMENT \'渠道ID\',\n  `amount` bigint(20) NOT NULL COMMENT \'转账金额,单位分\',\n  `currency` varchar(3) NOT NULL DEFAULT \'cny\' COMMENT \'三位货币代码,人民币:cny\',\n  `status` tinyint(6) NOT NULL DEFAULT \'0\' COMMENT \'转账状态:0-订单生成,1-转账中,2-转账成功,3-转账失败,4-业务处理完成\',\n  `result` tinyint(6) NOT NULL DEFAULT \'0\' COMMENT \'转账结果:0-不确认结果,1-等待手动处理,2-确认成功,3-确认失败\',\n  `client_ip` varchar(32) DEFAULT NULL COMMENT \'客户端IP\',\n  `device` varchar(64) DEFAULT NULL COMMENT \'设备\',\n  `remark_info` varchar(256) DEFAULT NULL COMMENT \'备注\',\n  `channel_user` varchar(32) DEFAULT NULL COMMENT \'渠道用户标识,如微信openId,支付宝账号\',\n  `user_name` varchar(24) DEFAULT NULL COMMENT \'用户姓名\',\n  `channel_mch_id` varchar(32) NOT NULL COMMENT \'渠道商户ID\',\n  `channel_order_no` varchar(32) DEFAULT NULL COMMENT \'渠道订单号\',\n  `channel_err_code` varchar(128) DEFAULT NULL COMMENT \'渠道错误码\',\n  `channel_err_msg` varchar(128) DEFAULT NULL COMMENT \'渠道错误描述\',\n  `extra` varchar(512) DEFAULT NULL COMMENT \'特定渠道发起时额外参数\',\n  `notify_url` varchar(128) NOT NULL COMMENT \'通知地址\',\n  `param1` varchar(64) DEFAULT NULL COMMENT \'扩展参数1\',\n  `param2` varchar(64) DEFAULT NULL COMMENT \'扩展参数2\',\n  `expire_time` datetime DEFAULT NULL COMMENT \'订单失效时间\',\n  `trans_succ_time` datetime DEFAULT NULL COMMENT \'订单转账成功时间\',\n  `create_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT \'创建时间\',\n  `update_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT \'更新时间\',\n  `del_flag` tinyint(1) DEFAULT \'0\' COMMENT \'0-正常，1-删除\',\n  `tenant_id` int(11) DEFAULT NULL COMMENT \'租户ID\',\n  PRIMARY KEY (`id`) USING BTREE,\n  UNIQUE KEY `uk_trans_order_id` (`trans_order_id`) USING BTREE,\n  UNIQUE KEY `uk_tenant_id_mch_trans_no` (`tenant_id`,`mch_trans_no`) USING BTREE\n) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT=\'转账订单表\'', '[{\"indexStyle\":\"UNIQUE\",\"indexName\":\"uk_tenant_id_mch_trans_no\",\"indexFieldIdOrName\":[\"tenant_id\",\"mch_trans_no\"],\"indexComment\":\"\",\"indexType\":\"BTREE\"},{\"indexStyle\":\"UNIQUE\",\"indexName\":\"uk_trans_order_id\",\"indexFieldIdOrName\":[\"trans_order_id\"],\"indexComment\":\"\",\"indexType\":\"BTREE\"}]', '[]', 0);
INSERT INTO `datasource_table` VALUES ('5a4ff043bc11ba4fd93dea330b59183e', 'risk_model', '风控_策略_策略组表', 'd18edef4341edbf3970a4d0b823204bd', 'jvs', 1, '2021-09-24 10:58:37', NULL, '2021-09-24 10:58:37', NULL, NULL, 'CREATE TABLE `risk_model` (\n  `id` char(50) NOT NULL COMMENT \'id\',\n  `no` varchar(255) DEFAULT NULL COMMENT \'编号\',\n  `name` varchar(255) DEFAULT NULL COMMENT \'名称\',\n  `description` varchar(2550) DEFAULT NULL COMMENT \'描述\',\n  `remark` varchar(2550) DEFAULT NULL COMMENT \'备注\',\n  `super_no` varchar(255) NOT NULL DEFAULT \'-1\' COMMENT \'上级编号,根节点为-1\',\n  `sort` int(11) DEFAULT NULL COMMENT \'顺序\',\n  `risk_node_type` enum(\'STRATEGY_GROUP\',\'STRATEGY\',\'RULE\') DEFAULT NULL COMMENT \'当前节点类型  \',\n  `create_by` varchar(255) DEFAULT NULL COMMENT \'创建人\',\n  `update_by` varchar(255) DEFAULT NULL COMMENT \'修改人\',\n  `create_time` datetime DEFAULT NULL COMMENT \'创建时间\',\n  `update_time` datetime DEFAULT NULL COMMENT \'修改时间\',\n  `tenant_id` char(50) DEFAULT NULL COMMENT \'租户\',\n  `param_obj_list` json DEFAULT NULL COMMENT \'前端表达式回显渲染\',\n  `bind_status` tinyint(1) DEFAULT \'0\' COMMENT \'是否绑定了变量,默认 0\',\n  `variable_no` varchar(255) DEFAULT NULL COMMENT \'绑定的变量no\',\n  `expression` text COMMENT \'规则之间的与或关系表达式\',\n  `strategy_type` varchar(255) DEFAULT NULL COMMENT \'决策类型,用于给决策分类,可选可输\',\n  `sub_no` longtext COMMENT \'下级编号,多个下级逗号分隔,用于决策组绑定决策使用\',\n  PRIMARY KEY (`id`) USING BTREE,\n  KEY `no_index` (`no`) USING BTREE\n) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT=\'风控_策略_策略组表\'', '[{\"indexStyle\":\"NORMAL\",\"indexName\":\"no_index\",\"indexFieldIdOrName\":[\"no\"],\"indexComment\":\"\",\"indexType\":\"BTREE\"}]', '[]', 0);
INSERT INTO `datasource_table` VALUES ('6217bbb43f64f528adac48aaa0227927', 'undo_log', 'seata-undo日志', 'd18edef4341edbf3970a4d0b823204bd', 'jvs', 1, '2021-09-24 10:58:43', NULL, '2021-09-24 10:58:43', NULL, NULL, 'CREATE TABLE `undo_log` (\n  `branch_id` bigint(20) NOT NULL,\n  `xid` varchar(100) NOT NULL,\n  `context` varchar(128) NOT NULL,\n  `rollback_info` longblob NOT NULL,\n  `log_status` int(11) NOT NULL,\n  `log_created` datetime NOT NULL,\n  `log_modified` datetime NOT NULL,\n  `ext` varchar(100) DEFAULT NULL,\n  PRIMARY KEY (`branch_id`,`xid`) USING BTREE,\n  UNIQUE KEY `ux_undo_log` (`xid`,`branch_id`) USING BTREE\n) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT=\'seata-undo日志\'', '[{\"indexStyle\":\"UNIQUE\",\"indexName\":\"ux_undo_log\",\"indexFieldIdOrName\":[\"xid\",\"branch_id\"],\"indexComment\":\"\",\"indexType\":\"BTREE\"}]', '[]', 0);
