INSERT INTO `datasource_table` VALUES ('6cf634f0f9536cb5bba8458d8bfcb181', 'new_tablea', '新表a000', 'd18edef4341edbf3970a4d0b823204bd', 'jvs', 1, '2021-09-24 10:58:33', NULL, '2021-09-24 10:58:33', NULL, NULL, 'CREATE TABLE `new_tablea` (\n  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT \'主键\',\n  `tenant_id` int(11) DEFAULT \'1\' COMMENT \'租户ID\',\n  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT \'创建时间\',\n  `dept_id` int(11) DEFAULT NULL COMMENT \'部门ID\',\n  `create_by` varchar(64) DEFAULT NULL COMMENT \'创建人\',\n  `del_flag` tinyint(1) DEFAULT \'0\' COMMENT \'逻辑删除\',\n  `adadf` tinyint(3) DEFAULT NULL COMMENT \'asdf\',\n  PRIMARY KEY (`id`) USING BTREE,\n  KEY `IDX_TENANT_ID` (`tenant_id`) USING BTREE,\n  KEY `IDX_DEPT_ID` (`dept_id`) USING BTREE,\n  KEY `IDX_DEL_FLAG` (`del_flag`) USING BTREE,\n  KEY `sadfawse` (`adadf`) USING BTREE COMMENT \'asdfa\'\n) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT=\'新表a000\'', '[{\"indexStyle\":\"NORMAL\",\"indexName\":\"sadfawse\",\"indexFieldIdOrName\":[\"adadf\"],\"indexComment\":\"asdfa\",\"indexType\":\"BTREE\"}]', '[]', 0);
