INSERT INTO `datasource_table` VALUES ('709f278bb324c685352e8169549d8a6f', 'sys_menu', '菜单权限表', 'd18edef4341edbf3970a4d0b823204bd', 'jvs', 1, '2021-09-24 10:58:39', NULL, '2021-09-24 10:58:39', NULL, NULL, 'CREATE TABLE `sys_menu` (\n  `id` char(50) NOT NULL COMMENT \'菜单ID\',\n  `name` varchar(128) NOT NULL COMMENT \'菜单名称\',\n  `url` varchar(255) DEFAULT NULL COMMENT \'url地址（如果为HTTP开头的，为外部地址，如果为/开头的地址，会自动拼接环境配置地址）\',\n  `parent_id` char(50) DEFAULT \'-1\' COMMENT \'父菜单ID(只支持一层父级),为-1时为最上级\',\n  `icon` varchar(32) DEFAULT NULL COMMENT \'图标\',\n  `client_name` varchar(255) DEFAULT NULL COMMENT \'客户端名称\',\n  `sort` int(11) DEFAULT \'1\' COMMENT \'默认排序值(用户可搜藏后自定义重新排序)\',\n  `create_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT \'创建时间\',\n  `update_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT \'更新时间\',\n  `tenant_id` char(50) DEFAULT NULL COMMENT \'租户ID\',\n  `type` enum(\'menu\',\'chart\',\'page\') DEFAULT \'menu\' COMMENT \'菜单类型,菜单，图表，列表页\',\n  `new_window` tinyint(1) DEFAULT NULL COMMENT \'是否新窗口打开\',\n  `from_id` char(50) DEFAULT NULL COMMENT \'来源ID\',\n  `del_flag` tinyint(1) DEFAULT \'0\' COMMENT \'逻辑删除\',\n  PRIMARY KEY (`id`) USING BTREE\n) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT=\'菜单权限表\'', '[]', '[]', 0);
