INSERT INTO `datasource_table` VALUES ('7bbebd28f0e6bc54210e69d57911ea69', 'sys_version', '版本环境上线记录表', 'd18edef4341edbf3970a4d0b823204bd', 'jvs', 1, '2021-09-24 10:58:42', NULL, '2021-09-24 10:58:42', NULL, NULL, 'CREATE TABLE `sys_version` (\n  `id` char(50) COLLATE utf8mb4_bin NOT NULL COMMENT \'主键ID\',\n  `env_name` varchar(64) COLLATE utf8mb4_bin NOT NULL COMMENT \'环境名称\',\n  `env_code` varchar(32) COLLATE utf8mb4_bin NOT NULL COMMENT \'环境编号(uat/pro)\',\n  `principal_project` varchar(64) COLLATE utf8mb4_bin NOT NULL COMMENT \'项目负责人\',\n  `principal_test` varchar(64) COLLATE utf8mb4_bin DEFAULT NULL COMMENT \'测试负责人\',\n  `principal_deploy` varchar(64) COLLATE utf8mb4_bin DEFAULT NULL COMMENT \'部署人员\',\n  `release_time` datetime DEFAULT NULL COMMENT \'上线时间\',\n  `project_name` varchar(64) COLLATE utf8mb4_bin NOT NULL COMMENT \'项目名\',\n  `service_name` varchar(64) COLLATE utf8mb4_bin NOT NULL COMMENT \'服务名\',\n  `service_desc` varchar(64) COLLATE utf8mb4_bin DEFAULT NULL COMMENT \'服务描述\',\n  `image_sit` varchar(255) COLLATE utf8mb4_bin NOT NULL COMMENT \'sit环境的docker镜像地址\',\n  `image_deploy` varchar(255) COLLATE utf8mb4_bin NOT NULL COMMENT \'部署的docker镜像地址\',\n  `version` varchar(32) COLLATE utf8mb4_bin NOT NULL COMMENT \'版本号\',\n  `port` int(11) DEFAULT NULL COMMENT \'服务暴露的端口号\',\n  `testing_report` varchar(255) COLLATE utf8mb4_bin DEFAULT NULL COMMENT \'测试报告\',\n  `function_list` varchar(255) COLLATE utf8mb4_bin DEFAULT NULL COMMENT \'功能清单\',\n  `operation_doc` varchar(255) COLLATE utf8mb4_bin DEFAULT NULL COMMENT \'操作文档，如SQL修改，由开发人员提供\',\n  `risk_desc` text COLLATE utf8mb4_bin COMMENT \'预估风险或影响范围说明\',\n  `create_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT \'创建时间\',\n  `update_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT \'更新时间\',\n  `tenant_id` char(50) COLLATE utf8mb4_bin DEFAULT \'1\' COMMENT \'租户ID\',\n  PRIMARY KEY (`id`) USING BTREE\n) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_bin COMMENT=\'版本环境上线记录表\'', '[]', '[]', 0);
INSERT INTO `datasource_table` VALUES ('7e4a664beaee1a5dd8e4792ece2248c9', 'rule_design', '逻辑引擎设计', 'd18edef4341edbf3970a4d0b823204bd', 'jvs', 1, '2021-09-24 10:58:38', NULL, '2021-09-24 10:58:38', NULL, NULL, 'CREATE TABLE `rule_design` (\n  `id` char(50) NOT NULL COMMENT \'主键\',\n  `enable` tinyint(1) DEFAULT \'0\' COMMENT \'状态\',\n  `secret` varchar(255) DEFAULT NULL COMMENT \'调用主键\',\n  `task` json DEFAULT NULL COMMENT \'定时任务逻辑\',\n  `design_drawing_json` json DEFAULT NULL COMMENT \'设计图\',\n  `execute_code` text COMMENT \'逻辑可执行脚本\',\n  `parameter_pos` json DEFAULT NULL COMMENT \'接口参数集合\',\n  `create_by` varchar(50) DEFAULT NULL COMMENT \'创建人名称\',\n  `create_by_id` char(50) DEFAULT NULL COMMENT \'创建者ID\',\n  `create_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT \'创建时间\',\n  `update_by` varchar(50) DEFAULT NULL COMMENT \'修改人\',\n  `update_time` datetime DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT \'更新时间\',\n  `flag` tinyint(1) DEFAULT \'0\' COMMENT \'是否删除 0未删除  1已删除\',\n  `remark` varchar(255) DEFAULT NULL COMMENT \'备注\',\n  `tenant_id` char(50) DEFAULT NULL COMMENT \'租户ID\',\n  `dept_id` char(50) DEFAULT NULL COMMENT \'部门id\',\n  PRIMARY KEY (`id`) USING BTREE,\n  KEY `secret` (`secret`) USING BTREE\n) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT=\'逻辑引擎设计\'', '[{\"indexStyle\":\"NORMAL\",\"indexName\":\"secret\",\"indexFieldIdOrName\":[\"secret\"],\"indexComment\":\"\",\"indexType\":\"BTREE\"}]', '[]', 0);
INSERT INTO `datasource_table` VALUES ('7e7c751157dc7889d1e0c5781a0ebe23', 'risk_strategy_flow', '风控_决策流', 'd18edef4341edbf3970a4d0b823204bd', 'jvs', 1, '2021-09-24 10:58:37', NULL, '2021-09-24 10:58:37', NULL, NULL, 'CREATE TABLE `risk_strategy_flow` (\n  `id` char(50) NOT NULL COMMENT \'主键\',\n  `no` varchar(40) DEFAULT NULL COMMENT \'编号\',\n  `name` varchar(255) NOT NULL COMMENT \'项目名称\',\n  `version` varchar(255) DEFAULT NULL COMMENT \'版本号\',\n  `status` tinyint(1) DEFAULT \'0\' COMMENT \'启用状态true启用;false停用) \',\n  `test_state` tinyint(1) DEFAULT \'0\' COMMENT \'测试状态 \',\n  `cover_type` tinyint(1) DEFAULT \'0\' COMMENT \'1:覆盖性决策,0:漏斗形 ,默认漏斗\',\n  `customer` varchar(255) DEFAULT NULL COMMENT \'客户来源,会使用此客户所属的三方账号来执行决策流\',\n  `create_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT \'创建时间\',\n  `update_time` datetime DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT \'修改时间\',\n  `create_by` varchar(255) DEFAULT NULL COMMENT \'创建人\',\n  `update_by` varchar(255) DEFAULT NULL COMMENT \'修改人\',\n  `remark` varchar(200) DEFAULT NULL COMMENT \'备注\',\n  `param_obj_list` json DEFAULT NULL COMMENT \'扩展字段\',\n  `tenant_id` char(50) DEFAULT NULL COMMENT \'租户\',\n  `del_flag` tinyint(1) DEFAULT \'0\' COMMENT \'逻辑删除 1是 0 否\',\n  `default_version` tinyint(1) DEFAULT \'0\' COMMENT \'是否是当前的默认版本\',\n  `group_no` varchar(40) DEFAULT NULL COMMENT \'版本分组编号\',\n  PRIMARY KEY (`id`) USING BTREE\n) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 ROW_FORMAT=DYNAMIC COMMENT=\'风控_决策流\'', '[]', '[]', 0);
INSERT INTO `datasource_table` VALUES ('871157f6169b343aeae080d169f2e25f', 'crud_form', '表单配置项', 'd18edef4341edbf3970a4d0b823204bd', 'jvs', 1, '2021-09-24 10:58:28', NULL, '2021-09-24 10:58:28', NULL, NULL, 'CREATE TABLE `crud_form` (\n  `id` char(50) NOT NULL COMMENT \'主键\',\n  `name` varchar(300) NOT NULL COMMENT \'表单唯一值\',\n  `enable` tinyint(1) NOT NULL DEFAULT \'0\' COMMENT \'是否启用\',\n  `view_json` longtext COMMENT \'渲染json\',\n  `type` enum(\'multiLevelForm\',\'normalForm\',\'detailForm\',\'flowable\',\'step\') NOT NULL COMMENT \'表单类型：多级，普通，详情，流程，步骤\',\n  `tenant_id` char(50) DEFAULT NULL COMMENT \'租户ID\',\n  `create_by` varchar(20) DEFAULT NULL COMMENT \'创建人\',\n  `update_by` varchar(20) DEFAULT NULL COMMENT \'修改人\',\n  `update_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT \'修改时间\',\n  `create_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT \'创建时间\',\n  `flag` tinyint(1) DEFAULT \'0\' COMMENT \'是否删除\',\n  `classify` varchar(64) DEFAULT NULL COMMENT \'归类\',\n  `description` varchar(255) DEFAULT NULL COMMENT \'表单描述\',\n  `is_deploy` tinyint(1) DEFAULT \'0\' COMMENT \'是否部署\',\n  `chinese_name` varchar(64) DEFAULT NULL COMMENT \'表单名称\',\n  PRIMARY KEY (`id`) USING BTREE\n) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT=\'表单配置项\'', '[]', '[]', 0);
INSERT INTO `datasource_table` VALUES ('8c5d6cfaf53e1180da6f821221f4937d', 'sys_user_copy1', '用户表', 'd18edef4341edbf3970a4d0b823204bd', 'jvs', 1, '2021-09-24 10:58:42', NULL, '2021-09-24 10:58:42', NULL, NULL, 'CREATE TABLE `sys_user_copy1` (\n  `id` char(50) COLLATE utf8mb4_bin NOT NULL COMMENT \'主键ID\',\n  `real_name` varchar(255) COLLATE utf8mb4_bin DEFAULT NULL COMMENT \'用户真名\',\n  `user_type` int(1) DEFAULT \'1\' COMMENT \'用户类型。\\r\\n1、后端用户\\r\\n2、前端用户\\r\\n3、其它业务系统用户\',\n  `user_name` varchar(64) COLLATE utf8mb4_bin NOT NULL COMMENT \'用户名\',\n  `email` varchar(40) COLLATE utf8mb4_bin DEFAULT NULL COMMENT \'邮件\',\n  `nick_name` varchar(255) COLLATE utf8mb4_bin DEFAULT NULL COMMENT \'昵称\',\n  `head_img` varchar(255) COLLATE utf8mb4_bin DEFAULT NULL COMMENT \'头像\',\n  `password` varchar(255) COLLATE utf8mb4_bin NOT NULL COMMENT \'密码\',\n  `job_name` varchar(50) COLLATE utf8mb4_bin DEFAULT NULL COMMENT \'职位\',\n  `salt` varchar(255) COLLATE utf8mb4_bin DEFAULT NULL COMMENT \'随机盐\',\n  `phone` char(11) COLLATE utf8mb4_bin DEFAULT NULL COMMENT \'手机号\',\n  `dept_name` varchar(50) COLLATE utf8mb4_bin DEFAULT NULL COMMENT \'部门名称\',\n  `dept_id` char(50) COLLATE utf8mb4_bin DEFAULT NULL COMMENT \'部门ID\',\n  `create_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT \'创建时间\',\n  `update_time` timestamp NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT \'修改时间\',\n  `lock_flag` tinyint(1) DEFAULT \'0\' COMMENT \'0-正常，9-锁定\',\n  `del_flag` tinyint(1) DEFAULT \'0\' COMMENT \'0-正常，1-删除\',\n  `wx_extend` json DEFAULT NULL COMMENT \'微信扩展信息\',\n  `wx_openid` varchar(32) COLLATE utf8mb4_bin DEFAULT NULL COMMENT \'微信openid\',\n  `tenant_id` char(50) COLLATE utf8mb4_bin DEFAULT NULL COMMENT \'租户ID\',\n  `admin_flag` tinyint(1) DEFAULT \'0\' COMMENT \'是否是管理员(如果为管理员，则跳过部门数据权限过滤)\',\n  `data_authority` varchar(255) COLLATE utf8mb4_bin DEFAULT NULL COMMENT \'用户的数据权限\',\n  `job_id` char(50) COLLATE utf8mb4_bin DEFAULT NULL COMMENT \'岗位Id\',\n  `sex` varchar(11) COLLATE utf8mb4_bin DEFAULT \'male\' COMMENT \'性别 \',\n  `dept_leader` tinyint(1) DEFAULT \'0\' COMMENT \'是否是部门负责人\',\n  `hire_date` date DEFAULT NULL COMMENT \'入职日期\',\n  `employee_no` varchar(255) COLLATE utf8mb4_bin DEFAULT NULL COMMENT \'职工编号\',\n  `birthday` date DEFAULT NULL COMMENT \'生日\',\n  `level` int(11) DEFAULT NULL COMMENT \'账号等级\',\n  PRIMARY KEY (`id`) USING BTREE\n) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_bin COMMENT=\'用户表\'', '[]', '[]', 0);
INSERT INTO `datasource_table` VALUES ('8c695674bea73738535ba501d2c50fb8', 'sys_label_value', '系统lable-value  此表废弃', 'd18edef4341edbf3970a4d0b823204bd', 'jvs', 1, '2021-09-24 10:58:39', NULL, '2021-09-24 10:58:39', NULL, NULL, 'CREATE TABLE `sys_label_value` (\n  `value` varchar(50) NOT NULL COMMENT \'标识\',\n  `label` text COMMENT \'解释\',\n  `classify` varchar(64) DEFAULT NULL COMMENT \'分类\',\n  `create_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT \'创建时间\',\n  `update_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT \'更新时间\',\n  PRIMARY KEY (`value`) USING BTREE,\n  UNIQUE KEY `value` (`value`) USING BTREE\n) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 ROW_FORMAT=DYNAMIC COMMENT=\'系统lable-value  此表废弃\'', '[{\"indexStyle\":\"UNIQUE\",\"indexName\":\"value\",\"indexFieldIdOrName\":[\"value\"],\"indexComment\":\"\",\"indexType\":\"BTREE\"}]', '[]', 0);
INSERT INTO `datasource_table` VALUES ('8d537d49604e660216f11697045334d1', 'risk_account_api_price', '风控项目-账号-接口 价格映射关系表', 'd18edef4341edbf3970a4d0b823204bd', 'jvs', 1, '2021-09-24 10:58:35', NULL, '2021-09-24 10:58:35', NULL, NULL, 'CREATE TABLE `risk_account_api_price` (\n  `id` char(50) NOT NULL COMMENT \'主键，账号访问接口的价格主键\',\n  `secret_id` char(50) DEFAULT NULL COMMENT \'访问账号的主键id\',\n  `api_name` varchar(255) DEFAULT NULL COMMENT \'接口的名称\',\n  `free` tinyint(1) DEFAULT \'1\' COMMENT \'是否免费\',\n  `price` int(10) DEFAULT \'0\' COMMENT \'接口的访问价格,使用分进行处理\',\n  `tenant_id` char(50) DEFAULT NULL COMMENT \'租户\',\n  PRIMARY KEY (`id`) USING BTREE\n) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT=\'风控项目-账号-接口 价格映射关系表\'', '[]', '[]', 0);
INSERT INTO `datasource_table` VALUES ('8dddc1c62334e212a244ca53e55b71c1', 'pay_refund_order', '退款订单表', 'd18edef4341edbf3970a4d0b823204bd', 'jvs', 1, '2021-09-24 10:58:35', NULL, '2021-09-24 10:58:35', NULL, NULL, 'CREATE TABLE `pay_refund_order` (\n  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT \'主键ID\',\n  `refund_order_id` varchar(30) NOT NULL COMMENT \'退款订单号\',\n  `pay_order_id` varchar(30) NOT NULL COMMENT \'支付订单号\',\n  `channel_pay_order_no` varchar(64) DEFAULT NULL COMMENT \'渠道支付单号\',\n  `mch_refund_no` varchar(30) NOT NULL COMMENT \'租户退款单号\',\n  `channel_id` varchar(24) NOT NULL COMMENT \'渠道ID\',\n  `pay_amount` bigint(20) NOT NULL COMMENT \'支付金额,单位分\',\n  `refund_amount` bigint(20) NOT NULL COMMENT \'退款金额,单位分\',\n  `currency` varchar(3) NOT NULL DEFAULT \'cny\' COMMENT \'三位货币代码,人民币:cny\',\n  `status` tinyint(6) NOT NULL DEFAULT \'0\' COMMENT \'退款状态:0-订单生成,1-退款中,2-退款成功,3-退款失败,4-业务处理完成\',\n  `result` tinyint(6) NOT NULL DEFAULT \'0\' COMMENT \'退款结果:0-不确认结果,1-等待手动处理,2-确认成功,3-确认失败\',\n  `client_ip` varchar(32) DEFAULT NULL COMMENT \'客户端IP\',\n  `device` varchar(64) DEFAULT NULL COMMENT \'设备\',\n  `remark_info` varchar(256) DEFAULT NULL COMMENT \'备注\',\n  `channel_user` varchar(32) DEFAULT NULL COMMENT \'渠道用户标识,如微信openId,支付宝账号\',\n  `user_name` varchar(24) DEFAULT NULL COMMENT \'用户姓名\',\n  `channel_mch_id` varchar(32) NOT NULL COMMENT \'渠道商户ID\',\n  `channel_order_no` varchar(32) DEFAULT NULL COMMENT \'渠道订单号\',\n  `channel_err_code` varchar(128) DEFAULT NULL COMMENT \'渠道错误码\',\n  `channel_err_msg` varchar(128) DEFAULT NULL COMMENT \'渠道错误描述\',\n  `extra` varchar(512) DEFAULT NULL COMMENT \'特定渠道发起时额外参数\',\n  `notify_url` varchar(128) DEFAULT NULL COMMENT \'通知地址\',\n  `param1` varchar(64) DEFAULT NULL COMMENT \'扩展参数1\',\n  `param2` varchar(64) DEFAULT NULL COMMENT \'扩展参数2\',\n  `expire_time` datetime DEFAULT NULL COMMENT \'订单失效时间\',\n  `refund_succ_time` datetime DEFAULT NULL COMMENT \'订单退款成功时间\',\n  `create_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT \'创建时间\',\n  `update_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT \'更新时间\',\n  `del_flag` tinyint(1) DEFAULT \'0\' COMMENT \'0-正常，1-删除\',\n  `tenant_id` int(11) DEFAULT NULL COMMENT \'租户ID\',\n  PRIMARY KEY (`id`) USING BTREE,\n  UNIQUE KEY `uk_refund_order_id` (`refund_order_id`) USING BTREE,\n  UNIQUE KEY `uk_MchId_MchOrderNo` (`tenant_id`,`mch_refund_no`) USING BTREE\n) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT=\'退款订单表\'', '[{\"indexStyle\":\"UNIQUE\",\"indexName\":\"uk_MchId_MchOrderNo\",\"indexFieldIdOrName\":[\"tenant_id\",\"mch_refund_no\"],\"indexComment\":\"\",\"indexType\":\"BTREE\"},{\"indexStyle\":\"UNIQUE\",\"indexName\":\"uk_refund_order_id\",\"indexFieldIdOrName\":[\"refund_order_id\"],\"indexComment\":\"\",\"indexType\":\"BTREE\"}]', '[]', 0);
INSERT INTO `datasource_table` VALUES ('8ee7634f81ccafc2e2080f8c0bc1b2d5', 'datasource_table', '表或视图管理', 'd18edef4341edbf3970a4d0b823204bd', 'jvs', 1, '2021-09-24 10:58:29', NULL, '2021-09-24 10:58:29', NULL, NULL, 'CREATE TABLE `datasource_table` (\n  `id` char(50) NOT NULL COMMENT \'主键\',\n  `table_name` varchar(100) NOT NULL COMMENT \'表英文名称\',\n  `info` varchar(200) NOT NULL COMMENT \'说明\',\n  `data_source_id` char(50) DEFAULT NULL COMMENT \'数据源ID\',\n  `data_source_name` varchar(100) DEFAULT NULL COMMENT \'数据源解释\',\n  `data_source_load` tinyint(1) DEFAULT NULL COMMENT \'是否数据源加载，如果是，则表示如果是数据源加载，则不允许有操作权限\',\n  `update_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT \'修改时间\',\n  `create_by` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL COMMENT \'创建人\',\n  `create_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT \'创建时间\',\n  `update_by` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL COMMENT \'修改人\',\n  `tenant_id` char(50) DEFAULT NULL COMMENT \'租户\',\n  `create_table_ddl` text COMMENT \'创建表语句\',\n  `indexs` text COMMENT \'表的索引信息\',\n  `fields` text COMMENT \'表的默认字段\',\n  `conflict` tinyint(1) DEFAULT \'0\' COMMENT \'是否和物理库的表结构不一致有冲突\',\n  PRIMARY KEY (`id`) USING BTREE,\n  UNIQUE KEY `UNIQ_DB_TABLE` (`table_name`,`data_source_id`) USING BTREE,\n  KEY `data_source_load` (`data_source_load`) USING BTREE\n) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT=\'表或视图管理\'', '[{\"indexStyle\":\"NORMAL\",\"indexName\":\"data_source_load\",\"indexFieldIdOrName\":[\"data_source_load\"],\"indexComment\":\"\",\"indexType\":\"BTREE\"},{\"indexStyle\":\"UNIQUE\",\"indexName\":\"UNIQ_DB_TABLE\",\"indexFieldIdOrName\":[\"table_name\",\"data_source_id\"],\"indexComment\":\"\",\"indexType\":\"BTREE\"}]', '[]', 0);
INSERT INTO `datasource_table` VALUES ('8f36746dc18d6e3788c6df240c6900c2', 'sys_job', '岗位表', 'd18edef4341edbf3970a4d0b823204bd', 'jvs', 1, '2021-09-24 10:58:39', NULL, '2021-09-24 10:58:39', NULL, NULL, 'CREATE TABLE `sys_job` (\n  `id` char(50) NOT NULL COMMENT \'主键\',\n  `name` varchar(50) CHARACTER SET utf8 DEFAULT NULL COMMENT \'岗位名称\',\n  `create_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT \'创建时间\',\n  `sort` int(11) DEFAULT NULL COMMENT \'默认排序值\',\n  `update_time` timestamp NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT \'修改时间\',\n  `del_flag` tinyint(1) DEFAULT \'0\' COMMENT \'是否删除  -1：已删除  0：正常\',\n  `tenant_id` char(50) DEFAULT \'1\' COMMENT \'租户ID默认1\',\n  `data_scope_type` enum(\'all_dept\',\'curr_dept\',\'curr_dept_tree\',\'all_job\',\'curr_job\',\'self\',\'customize\') CHARACTER SET utf8 NOT NULL DEFAULT \'all_dept\' COMMENT \'数据权限类型\',\n  `custom_scope` json DEFAULT NULL COMMENT \'自定义数据权限\',\n  PRIMARY KEY (`id`) USING BTREE\n) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT=\'岗位表\'', '[]', '[]', 0);
INSERT INTO `datasource_table` VALUES ('95bf9ef5e87986dfa6e6fb42e9acac5a', 'demo_class', 'demo_class', 'd18edef4341edbf3970a4d0b823204bd', 'jvs', 1, '2021-09-24 10:58:31', NULL, '2021-09-24 10:58:31', NULL, NULL, 'CREATE TABLE `demo_class` (\n  `id` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT \'id\',\n  `class_num` varchar(255) DEFAULT NULL COMMENT \'班级\',\n  `grade_num` varchar(255) DEFAULT NULL COMMENT \'年级\',\n  `member_count` int(11) unsigned NOT NULL DEFAULT \'0\' COMMENT \'班级人数\',\n  `top` int(11) DEFAULT NULL COMMENT \'班级排名\',\n  `description` varchar(255) DEFAULT NULL COMMENT \'班级简介\',\n  `head_teacher` varchar(255) DEFAULT NULL COMMENT \'班主任姓名\',\n  `head_teacher_phone` varchar(255) DEFAULT NULL COMMENT \'班主任联系方式\',\n  PRIMARY KEY (`id`) USING BTREE\n) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4', '[]', '[]', 0);
INSERT INTO `datasource_table` VALUES ('975d617ac44336af29b2cc4ba86ca6b9', 'bss_websites', 'bss产品信息介绍', 'd18edef4341edbf3970a4d0b823204bd', 'jvs', 1, '2021-09-24 10:58:28', NULL, '2021-09-24 10:58:28', NULL, NULL, 'CREATE TABLE `bss_websites` (\n  `id` char(50) NOT NULL COMMENT \'主键\',\n  `type` varchar(255) DEFAULT NULL COMMENT \'大类\',\n  `identification` json DEFAULT NULL COMMENT \'标识\',\n  `img` text COMMENT \'小图片\',\n  `name` varchar(255) DEFAULT NULL COMMENT \'名称\',\n  `subtitle` varchar(255) DEFAULT NULL COMMENT \'副标题\',\n  `synopsis` varchar(255) DEFAULT NULL COMMENT \' 简介\',\n  `quantity` int(4) DEFAULT NULL COMMENT \' 数量\',\n  `info` longtext COMMENT \'内容介绍\',\n  `logs` json DEFAULT NULL COMMENT \'更新记录\',\n  `tags` json DEFAULT NULL COMMENT \'版本记录\',\n  `update_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT \'更新时间\',\n  PRIMARY KEY (`id`) USING BTREE\n) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT=\'bss产品信息介绍\'', '[]', '[]', 0);
INSERT INTO `datasource_table` VALUES ('97c9fa1282c987706aa2cd3c2ca4072c', 'sys_dict_item', '字典项', 'd18edef4341edbf3970a4d0b823204bd', 'jvs', 1, '2021-09-24 10:58:39', NULL, '2021-09-24 10:58:39', NULL, NULL, 'CREATE TABLE `sys_dict_item` (\n  `id` char(50) NOT NULL COMMENT \'编号\',\n  `dict_id` char(50) NOT NULL,\n  `value` varchar(100) DEFAULT NULL,\n  `label` varchar(100) DEFAULT NULL,\n  `type` varchar(100) DEFAULT NULL,\n  `description` varchar(100) DEFAULT NULL,\n  `sort` int(10) NOT NULL DEFAULT \'0\' COMMENT \'排序（升序）\',\n  `create_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT \'创建时间\',\n  `update_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT \'更新时间\',\n  `remarks` varchar(255) DEFAULT NULL,\n  `del_flag` char(1) DEFAULT \'0\',\n  `tenant_id` char(50) NOT NULL DEFAULT \'0\' COMMENT \'所属租户\',\n  PRIMARY KEY (`id`) USING BTREE\n) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT=\'字典项\'', '[]', '[]', 0);
INSERT INTO `datasource_table` VALUES ('97ea032528660840c2d831f9e5757db1', 'sys_request_log', '请求日志', 'd18edef4341edbf3970a4d0b823204bd', 'jvs', 1, '2021-09-24 10:58:41', NULL, '2021-09-24 10:58:41', NULL, NULL, 'CREATE TABLE `sys_request_log` (\n  `id` char(50) NOT NULL,\n  `business_name` varchar(32) DEFAULT NULL COMMENT \'项目名\',\n  `function_name` varchar(32) DEFAULT NULL COMMENT \'功能名\',\n  `start_time` datetime DEFAULT NULL COMMENT \'开始时间\',\n  `end_time` datetime DEFAULT NULL COMMENT \'结束时间\',\n  `method_name` varchar(128) DEFAULT NULL COMMENT \'方法名\',\n  `class_name` varchar(255) DEFAULT NULL COMMENT \'类名\',\n  `thread_user` json DEFAULT NULL COMMENT \'当前用户对象JSON\',\n  `parameters` json DEFAULT NULL COMMENT \'请求参数对象JSON\',\n  `tid` varchar(128) DEFAULT NULL COMMENT \'tid\',\n  `version` varchar(32) DEFAULT NULL COMMENT \'版本号\',\n  `consuming_time` mediumtext COMMENT \'耗时\',\n  `return_obj` json DEFAULT NULL COMMENT \'返回对象JSON\',\n  `status` tinyint(1) DEFAULT NULL COMMENT \'返回状态是否是成功\',\n  `ip` varchar(30) DEFAULT NULL COMMENT \'请求IP地址\',\n  `elements` json DEFAULT NULL COMMENT \'异常数据JSON\',\n  `exception_message` varchar(128) DEFAULT NULL COMMENT \'异常消息数据\',\n  `env` varchar(255) DEFAULT NULL COMMENT \'环境参数\',\n  `api` text COMMENT \'api地址\',\n  `type` tinyint(1) DEFAULT NULL COMMENT \'日志类型:1-AOP拦截,2-过程中的日志,3-自定义日志\',\n  `user_name` varchar(255) DEFAULT NULL COMMENT \'用户名称\',\n  `create_date` datetime DEFAULT NULL COMMENT \'创建时间\',\n  `tenant_id` char(50) DEFAULT NULL COMMENT \'租户id\',\n  PRIMARY KEY (`id`) USING BTREE\n) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT=\'请求日志\'', '[]', '[]', 0);
INSERT INTO `datasource_table` VALUES ('9a1fdc2bd8017963940994f790a7a476', 'sys_index', '首页配置  - 此表废弃', 'd18edef4341edbf3970a4d0b823204bd', 'jvs', 1, '2021-09-24 10:58:39', NULL, '2021-09-24 10:58:39', NULL, NULL, 'CREATE TABLE `sys_index` (\n  `id` char(50) COLLATE utf8mb4_bin NOT NULL COMMENT \'主键ID\',\n  `user_id` char(50) COLLATE utf8mb4_bin DEFAULT NULL COMMENT \'用户ID\',\n  `data` text COLLATE utf8mb4_bin COMMENT \'具体数据\',\n  `height` int(4) DEFAULT NULL COMMENT \'高度\',\n  `position` enum(\'all\',\'left\',\'right\') COLLATE utf8mb4_bin DEFAULT NULL COMMENT \'位置\',\n  `page` varchar(255) COLLATE utf8mb4_bin DEFAULT NULL COMMENT \'地址\',\n  `type` enum(\'message\',\'chart\',\'backlog\',\'news\',\'calendar\',\'page\',\'wel\',\'http\') COLLATE utf8mb4_bin DEFAULT NULL COMMENT \'类型\',\n  `title` varchar(64) COLLATE utf8mb4_bin DEFAULT NULL COMMENT \'名字\',\n  `sort` int(2) DEFAULT \'1000\' COMMENT \'排序\',\n  `tenant_id` char(50) COLLATE utf8mb4_bin DEFAULT NULL COMMENT \'租户ID\',\n  `display_title` tinyint(1) DEFAULT NULL COMMENT \'是否显示标题\',\n  PRIMARY KEY (`id`) USING BTREE\n) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_bin COMMENT=\'首页配置  - 此表废弃\'', '[]', '[]', 0);
INSERT INTO `datasource_table` VALUES ('9c063424bfa4b3ee607e756cdd446bf9', 't_school', '校园', 'd18edef4341edbf3970a4d0b823204bd', 'jvs', 1, '2021-09-24 10:58:43', NULL, '2021-09-24 10:58:43', NULL, NULL, 'CREATE TABLE `t_school` (\n  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT \'ID\',\n  `name` varchar(255) DEFAULT NULL COMMENT \'校园名称\',\n  `person_num` int(3) DEFAULT NULL COMMENT \'总人数\',\n  `note` text COMMENT \'备注信息\',\n  `create_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT \'创建时间\',\n  `update_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT \'更新时间\',\n  `create_by` varchar(40) DEFAULT NULL COMMENT \'创建人\',\n  `update_by` varchar(40) DEFAULT NULL COMMENT \'更新人\',\n  `tenant_id` int(11) NOT NULL DEFAULT \'1\' COMMENT \'所属租户\',\n  `del_flag` char(1) DEFAULT \'0\' COMMENT \'删除状态\',\n  PRIMARY KEY (`id`) USING BTREE\n) ENGINE=InnoDB AUTO_INCREMENT=9 DEFAULT CHARSET=utf8mb4 COMMENT=\'校园\'', '[]', '[]', 0);
INSERT INTO `datasource_table` VALUES ('9e3a0909da2bd31104ea9fbaafc0f03c', 'risk_variable', '风控_变量表', 'd18edef4341edbf3970a4d0b823204bd', 'jvs', 1, '2021-09-24 10:58:37', NULL, '2021-09-24 10:58:37', NULL, NULL, 'CREATE TABLE `risk_variable` (\n  `id` char(50) NOT NULL COMMENT \'id\',\n  `no` varchar(255) DEFAULT NULL COMMENT \'编号\',\n  `name` varchar(255) DEFAULT NULL COMMENT \'变量名\',\n  `remark` text COMMENT \'备注 变量说明\',\n  `create_time` datetime DEFAULT NULL COMMENT \'创建时间\',\n  `create_by` varchar(11) DEFAULT NULL COMMENT \'创建者\',\n  `expression` longtext COMMENT \'变量表达式 如 sum ( a, b ) \',\n  `details` json DEFAULT NULL COMMENT \'变量详细内容,前端展示回显用\',\n  `test_data` json DEFAULT NULL COMMENT \'上次测试数据\',\n  `tenant_id` char(50) DEFAULT NULL COMMENT \'租户\',\n  `apis` json DEFAULT NULL COMMENT \'接口信息\',\n  `expr_details` text COMMENT \'表达式的富文本信息\',\n  `del_flag` tinyint(1) DEFAULT \'0\' COMMENT \'逻辑删除 1是 0 否\',\n  `reference_count` int(11) NOT NULL DEFAULT \'0\' COMMENT \'被引用次数\',\n  PRIMARY KEY (`id`) USING BTREE\n) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT=\'风控_变量表\'', '[]', '[]', 0);
