INSERT INTO `datasource_table` VALUES ('a0e2a460c468ad229188f5c490d5d57a', 'demo', 'demo', 'd18edef4341edbf3970a4d0b823204bd', 'jvs', 1, '2021-09-24 10:58:30', NULL, '2021-09-24 10:58:30', NULL, NULL, 'CREATE TABLE `demo` (\n  `id` int(11) NOT NULL AUTO_INCREMENT,\n  `data` json DEFAULT NULL,\n  `result` varchar(255) DEFAULT NULL,\n  PRIMARY KEY (`id`) USING BTREE\n) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 ROW_FORMAT=DYNAMIC', '[]', '[]', 0);
INSERT INTO `datasource_table` VALUES ('a49b8222c7be3edb5d944cb653ea2178', 'risk_secret', '数据名称表（三方接口的凭证表）', 'd18edef4341edbf3970a4d0b823204bd', 'jvs', 1, '2021-09-24 10:58:37', NULL, '2021-09-24 10:58:37', NULL, NULL, 'CREATE TABLE `risk_secret` (\n  `id` char(50) NOT NULL COMMENT \'主键\',\n  `secret` varchar(255) DEFAULT NULL COMMENT \'自动生成的凭证\',\n  `type` tinyint(1) DEFAULT NULL COMMENT \'是否是失败即返回\',\n  `json` json DEFAULT NULL COMMENT \'存的某些第三方的帐号如token,key 加密串等信息\',\n  `secret_name` varchar(255) DEFAULT NULL COMMENT \'凭证名称（数据产品的名称）\',\n  `short_name` varchar(255) DEFAULT NULL COMMENT \'三方平台简称\',\n  `status` tinyint(1) DEFAULT \'0\' COMMENT \'状态\',\n  `tenant_id` char(50) DEFAULT NULL COMMENT \'租户\',\n  `create_time` datetime DEFAULT NULL COMMENT \'创建时间\',\n  PRIMARY KEY (`id`) USING BTREE\n) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT=\'数据名称表（三方接口的凭证表）\'', '[]', '[]', 0);
INSERT INTO `datasource_table` VALUES ('a4c7a9e9e68497dbb2a28072c8130326', 'sys_progress', '处理过程监听', 'd18edef4341edbf3970a4d0b823204bd', 'jvs', 1, '2021-09-24 10:58:40', NULL, '2021-09-24 10:58:40', NULL, NULL, 'CREATE TABLE `sys_progress` (\n  `id` char(50) COLLATE utf8mb4_bin NOT NULL COMMENT \'主键ID\',\n  `business_id` char(50) COLLATE utf8mb4_bin DEFAULT NULL COMMENT \'业务的ID值\',\n  `business_type` varchar(20) COLLATE utf8mb4_bin DEFAULT NULL COMMENT \'类型\',\n  `end` tinyint(1) DEFAULT NULL COMMENT \'是否处理完\',\n  `tenant_id` char(50) COLLATE utf8mb4_bin DEFAULT NULL COMMENT \'租户ID\',\n  PRIMARY KEY (`id`) USING BTREE\n) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_bin COMMENT=\'处理过程监听\'', '[]', '[]', 0);
INSERT INTO `datasource_table` VALUES ('a9e9da03b5e845ea1392de5acd91a6d4', 'brand', 'brand', 'd18edef4341edbf3970a4d0b823204bd', 'jvs', 1, '2021-09-24 10:58:28', NULL, '2021-09-24 10:58:28', NULL, NULL, 'CREATE TABLE `brand` (\n  `Id` bigint(11) NOT NULL AUTO_INCREMENT,\n  `Name` varchar(255) DEFAULT \'\' COMMENT \'品牌名\',\n  `PostDate` datetime DEFAULT NULL COMMENT \'最后修改时间\',\n  `IsDisabled` varchar(1) DEFAULT \'0\' COMMENT \'是否禁用0,没禁用，1，已禁用\',\n  `CreateDate` datetime DEFAULT NULL COMMENT \'创建时间\',\n  `CreateUserId` bigint(20) DEFAULT NULL COMMENT \'操作人id\',\n  `AmendUserId` bigint(20) DEFAULT NULL COMMENT \'修改资料用户id\',\n  `IsDelete` varchar(1) DEFAULT \'0\' COMMENT \'是否删除0，未删除，1已删除\',\n  `LogoUrl` varchar(255) DEFAULT \'\' COMMENT \'logo地址\',\n  `FirstLetter` varchar(100) DEFAULT \'\' COMMENT \'拼音首字母\',\n  `Status` int(2) DEFAULT \'1\',\n  PRIMARY KEY (`Id`) USING BTREE\n) ENGINE=InnoDB DEFAULT CHARSET=utf8', '[]', '[]', 0);
INSERT INTO `datasource_table` VALUES ('ab02fe83c0464f40d27f9512363581e5', 't_student', '学生', 'd18edef4341edbf3970a4d0b823204bd', 'jvs', 1, '2021-09-24 10:58:43', NULL, '2021-09-24 10:58:43', NULL, NULL, 'CREATE TABLE `t_student` (\n  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT \'ID\',\n  `class_id` int(11) NOT NULL COMMENT \'班级ID\',\n  `name` varchar(255) DEFAULT NULL COMMENT \'姓名\',\n  `gender` enum(\'MALE\',\'FEMALE\') DEFAULT NULL COMMENT \'性别\',\n  `age` int(3) DEFAULT NULL COMMENT \'年龄\',\n  `birthday` date DEFAULT NULL COMMENT \'生日\',\n  `id_card` char(18) DEFAULT NULL COMMENT \'身份证\',\n  `note` text COMMENT \'备注信息\',\n  `create_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT \'创建时间\',\n  `update_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT \'更新时间\',\n  `create_by` varchar(40) DEFAULT NULL COMMENT \'创建人\',\n  `update_by` varchar(40) DEFAULT NULL COMMENT \'更新人\',\n  `tenant_id` int(11) NOT NULL DEFAULT \'1\' COMMENT \'所属租户\',\n  `del_flag` char(1) DEFAULT \'0\' COMMENT \'删除状态\',\n  PRIMARY KEY (`id`) USING BTREE\n) ENGINE=InnoDB AUTO_INCREMENT=21358 DEFAULT CHARSET=utf8mb4 COMMENT=\'学生\'', '[]', '[]', 0);
