INSERT INTO `datasource_table` VALUES ('b0b50c7511ad2bd067fdb6ddca36cd68', 'hr_pro', 'hr_pro', 'd18edef4341edbf3970a4d0b823204bd', 'jvs', 1, '2021-09-24 10:58:32', NULL, '2021-09-24 10:58:32', NULL, NULL, 'CREATE TABLE `hr_pro` (\n  `id` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT \'项目id\',\n  `name` varchar(255) DEFAULT NULL COMMENT \'项目名称\',\n  `desc` varchar(255) DEFAULT NULL COMMENT \'项目描述\',\n  `dept_id` varchar(255) DEFAULT NULL COMMENT \'归属部门\',\n  `leader` varchar(255) DEFAULT NULL COMMENT \'负责人\',\n  `expect_hour` double(11,4) DEFAULT NULL COMMENT \'预期工时\',\n  `expect_member_count` int(11) DEFAULT NULL COMMENT \'计划人数\',\n  `project_status` varchar(255) DEFAULT NULL COMMENT \'项目状态\',\n  `project_progress` varchar(255) DEFAULT NULL COMMENT \'项目进度\',\n  `personnel_progress` varchar(255) DEFAULT NULL COMMENT \'人员进度\',\n  `dev_type` varchar(255) DEFAULT NULL COMMENT \'开发类型\',\n  `create_time` datetime DEFAULT NULL COMMENT \'创建时间\',\n  `start_time` datetime DEFAULT NULL COMMENT \'启动时间\',\n  `delivered_time` datetime DEFAULT NULL COMMENT \'交付时间\',\n  `overdue` text COMMENT \'逾期情况\',\n  PRIMARY KEY (`id`) USING BTREE\n) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=utf8mb4 ROW_FORMAT=DYNAMIC', '[]', '[]', 0);
INSERT INTO `datasource_table` VALUES ('b66c55d1758abb21fa613d1b32483a3e', 'z_class', 'z_class', 'd18edef4341edbf3970a4d0b823204bd', 'jvs', 1, '2021-09-24 10:58:43', NULL, '2021-09-24 10:58:43', NULL, NULL, 'CREATE TABLE `z_class` (\n  `id` int(11) NOT NULL,\n  `z_school_id` int(11) DEFAULT NULL,\n  `name` varchar(255) DEFAULT NULL,\n  `type` varchar(255) DEFAULT NULL,\n  `banzhuren` varchar(255) DEFAULT NULL,\n  `phone` varchar(255) DEFAULT NULL,\n  `banxun` varchar(255) DEFAULT NULL,\n  `yiming` varchar(255) DEFAULT NULL,\n  `zhuyaojiangxiang` varchar(255) DEFAULT NULL,\n  `qitalaoshi` varchar(255) DEFAULT NULL,\n  PRIMARY KEY (`id`) USING BTREE\n) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 ROW_FORMAT=DYNAMIC', '[]', '[]', 0);
INSERT INTO `datasource_table` VALUES ('b709d2513e086c8904083943998ea38c', 'im_chat_group_message', '群聊全量消息表', 'd18edef4341edbf3970a4d0b823204bd', 'jvs', 1, '2021-09-24 10:58:33', NULL, '2021-09-24 10:58:33', NULL, NULL, 'CREATE TABLE `im_chat_group_message` (\n  `id` char(50) COLLATE utf8mb4_bin NOT NULL COMMENT \'主键ID\',\n  `group_id` varchar(50) COLLATE utf8mb4_bin NOT NULL COMMENT \'群组id\',\n  `from_user_id` char(50) COLLATE utf8mb4_bin NOT NULL COMMENT \'发送消息用户id\',\n  `message` json NOT NULL COMMENT \'聊天消息体\',\n  `create_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT \'创建时间\',\n  `update_time` timestamp NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT \'修改时间\',\n  `del_flag` tinyint(1) DEFAULT \'0\' COMMENT \'0-正常，1-删除\',\n  `tenant_id` char(50) COLLATE utf8mb4_bin DEFAULT NULL COMMENT \'租户ID\',\n  PRIMARY KEY (`id`) USING BTREE,\n  KEY `idx_group_id` (`group_id`) USING BTREE,\n  KEY `idx_from_user_id` (`from_user_id`) USING BTREE,\n  KEY `idx_tenant_id` (`tenant_id`) USING BTREE\n) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_bin COMMENT=\'群聊全量消息表\'', '[{\"indexStyle\":\"NORMAL\",\"indexName\":\"idx_from_user_id\",\"indexFieldIdOrName\":[\"from_user_id\"],\"indexComment\":\"\",\"indexType\":\"BTREE\"},{\"indexStyle\":\"NORMAL\",\"indexName\":\"idx_tenant_id\",\"indexFieldIdOrName\":[\"tenant_id\"],\"indexComment\":\"\",\"indexType\":\"BTREE\"},{\"indexStyle\":\"NORMAL\",\"indexName\":\"idx_group_id\",\"indexFieldIdOrName\":[\"group_id\"],\"indexComment\":\"\",\"indexType\":\"BTREE\"}]', '[]', 0);
INSERT INTO `datasource_table` VALUES ('bad9c0bee0d837fe59e31418f39b4cc4', 'sys_template', '模板管理，短信，邮件、文档。', 'd18edef4341edbf3970a4d0b823204bd', 'jvs', 1, '2021-09-24 10:58:41', NULL, '2021-09-24 10:58:41', NULL, NULL, 'CREATE TABLE `sys_template` (\n  `id` char(50) NOT NULL COMMENT \'ID\',\n  `name` varchar(50) DEFAULT NULL COMMENT \'名称\',\n  `title` varchar(255) DEFAULT NULL COMMENT \'短信title签名\',\n  `content` longtext COMMENT \'模板内容\',\n  `tenant_id` char(50) DEFAULT NULL COMMENT \'租户ID\',\n  `type` tinyint(2) DEFAULT NULL COMMENT \'类型\\\\1-短信、2-邮件、3-文档\',\n  `update_by` varchar(100) DEFAULT NULL COMMENT \'修改人\',\n  `create_by` varchar(100) DEFAULT NULL COMMENT \'创建人\',\n  `create_time` datetime NOT NULL COMMENT \'创建时间\',\n  `business_type` tinyint(2) DEFAULT \'1\' COMMENT \'类型1-系统类型,2-业务类型 如果为系统类型的，不允许删除。不允许修改名称。 但可以修改内容\',\n  PRIMARY KEY (`id`) USING BTREE\n) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT=\'模板管理，短信，邮件、文档。\'', '[]', '[]', 0);
INSERT INTO `datasource_table` VALUES ('bccd76e58f62c8ba44d3b5b1924b72a2', 'sys_user_permission', '用户与资源权限的权限关联', 'd18edef4341edbf3970a4d0b823204bd', 'jvs', 1, '2021-09-24 10:58:42', NULL, '2021-09-24 10:58:42', NULL, NULL, 'CREATE TABLE `sys_user_permission` (\n  `user_id` char(50) NOT NULL COMMENT \'主键\',\n  `permission_id` char(50) NOT NULL COMMENT \'资源标识ID\',\n  `type` enum(\'menu\',\'function\') NOT NULL COMMENT \'资源来源。菜单、功能、数据\',\n  `alias` varchar(255) DEFAULT NULL COMMENT \'用户自定义别名(用户授权后会自动将菜单名称同步到此)\',\n  `tenant_id` char(50) DEFAULT NULL COMMENT \'租户ID\',\n  PRIMARY KEY (`user_id`,`permission_id`) USING BTREE\n) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT=\'用户与资源权限的权限关联\'', '[]', '[]', 0);
INSERT INTO `datasource_table` VALUES ('bd15c9b17e88852fcb66ef03ef69a03c', 'demo_seata_goods', 'demo_seata_goods', 'd18edef4341edbf3970a4d0b823204bd', 'jvs', 1, '2021-09-24 10:58:31', NULL, '2021-09-24 10:58:31', NULL, NULL, 'CREATE TABLE `demo_seata_goods` (\n  `id` int(11) NOT NULL,\n  `name` varchar(255) DEFAULT NULL,\n  `stock` int(11) DEFAULT NULL,\n  `tenant_id` int(11) DEFAULT NULL,\n  PRIMARY KEY (`id`) USING BTREE\n) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4', '[]', '[]', 0);
INSERT INTO `datasource_table` VALUES ('bea43659cc513b22e8843b0ccf69f1d4', 'dc_library', '知识库', 'd18edef4341edbf3970a4d0b823204bd', 'jvs', 1, '2021-09-24 10:58:29', NULL, '2021-09-24 10:58:29', NULL, NULL, 'CREATE TABLE `dc_library` (\n  `id` char(50) NOT NULL,\n  `name` varchar(128) DEFAULT NULL COMMENT \'名称\',\n  `share_role` enum(\'user\',\'register\',\'all\') DEFAULT \'user\' COMMENT \'查看权限/成员开放、注册用户、完全开放\',\n  `share_password` varchar(255) DEFAULT NULL COMMENT \'分享密码\',\n  `share` tinyint(1) DEFAULT \'0\' COMMENT \'分享/不分享，分享\',\n  `share_validity_type` enum(\'PERPETUAL\',\'ONE_DAY\',\'SEVEN_DAY\',\'THIRTY_DAY\') DEFAULT NULL COMMENT \'分享有效期\',\n  `share_end_time` datetime DEFAULT NULL COMMENT \'分享结束时间\',\n  `share_link` varchar(255) DEFAULT NULL COMMENT \'分享的文档链接,二维码可通过链接生成即可\',\n  `share_key` varchar(64) DEFAULT NULL COMMENT \'分享key\',\n  `type` enum(\'knowledge\',\'directory\',\'document_html\',\'document_xlsx\',\'document_map\',\'document_flow\',\'document_unrecognized\') DEFAULT \'knowledge\' COMMENT \'类型\\\\知识库、目录、文本文档、表格文档、脑图文档、流程文档。\',\n  `parent_id` char(50) DEFAULT \'0\' COMMENT \'上级ID\',\n  `size` double(11,4) DEFAULT \'0.0000\' COMMENT \'文档大小\',\n  `file_path` text COMMENT \'文件存储路径\',\n  `create_by` varchar(50) DEFAULT NULL COMMENT \'创建人名称\',\n  `create_by_id` char(50) DEFAULT NULL COMMENT \'创建者ID\',\n  `create_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT \'创建时间\',\n  `update_by` varchar(50) DEFAULT NULL COMMENT \'修改人\',\n  `update_time` datetime DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT \'更新时间\',\n  `del_flag` tinyint(1) DEFAULT \'0\' COMMENT \'是否删除 0未删除  1已删除\',\n  `description` varchar(255) DEFAULT NULL COMMENT \'描述\',\n  `remark` varchar(255) DEFAULT NULL COMMENT \'备注\',\n  `tenant_id` char(50) DEFAULT NULL COMMENT \'租户ID\',\n  `job_id` char(50) DEFAULT NULL COMMENT \'岗位id\',\n  `dept_id` char(50) DEFAULT NULL COMMENT \'部门id\',\n  `sub_json` json DEFAULT NULL COMMENT \'子集目录的json\',\n  `order_id` int(11) DEFAULT \'0\' COMMENT \'排序字段\',\n  `editing_by` char(50) DEFAULT NULL COMMENT \'该文档此时正在被哪个用户编辑,没有则为null\',\n  `knowledge_id` char(50) DEFAULT NULL COMMENT \'知识库id\',\n  `color` varchar(20) DEFAULT NULL COMMENT \'知识库颜色\',\n  `read_notify` tinyint(1) DEFAULT \'1\' COMMENT \'自动发送查看提醒开关\',\n  PRIMARY KEY (`id`) USING BTREE,\n  KEY `idx_knowledge_id` (`knowledge_id`) USING BTREE,\n  KEY `idx_parent_id` (`parent_id`) USING BTREE\n) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT=\'知识库\'', '[{\"indexStyle\":\"NORMAL\",\"indexName\":\"idx_knowledge_id\",\"indexFieldIdOrName\":[\"knowledge_id\"],\"indexComment\":\"\",\"indexType\":\"BTREE\"},{\"indexStyle\":\"NORMAL\",\"indexName\":\"idx_parent_id\",\"indexFieldIdOrName\":[\"parent_id\"],\"indexComment\":\"\",\"indexType\":\"BTREE\"}]', '[]', 0);
INSERT INTO `datasource_table` VALUES ('bfd4b2f43050bf66428dd592e69008bf', 'risk_project', '风控管理', 'd18edef4341edbf3970a4d0b823204bd', 'jvs', 1, '2021-09-24 10:58:37', NULL, '2021-09-24 10:58:37', NULL, NULL, 'CREATE TABLE `risk_project` (\n  `id` int(20) NOT NULL AUTO_INCREMENT COMMENT \'主键\',\n  `project_no` varchar(40) DEFAULT NULL COMMENT \'编号\',\n  `name` varchar(255) NOT NULL COMMENT \'项目名称\',\n  `phase` varchar(20) DEFAULT NULL COMMENT \'风控阶段(相当于备注使用，没有业务参与)\',\n  `status` tinyint(1) DEFAULT \'0\' COMMENT \'风控包状态true启用;false停用) \',\n  `test_state` tinyint(1) DEFAULT \'0\' COMMENT \'测试状态 \',\n  `create_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT \'创建时间\',\n  `update_time` datetime DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT \'修改时间\',\n  `create_by` varchar(255) DEFAULT NULL COMMENT \'创建人\',\n  `expression` text COMMENT \'表达式的json\',\n  `remark` varchar(200) DEFAULT NULL COMMENT \'备注\',\n  `estimated_price` int(4) DEFAULT NULL COMMENT \'设计出来的预估价格,通过按钮控制\',\n  `param_obj_list` json DEFAULT NULL COMMENT \'前端表达式回显渲染\',\n  `customer` varchar(255) DEFAULT NULL COMMENT \'该项目属于的客户名称\',\n  `dept_id` int(11) DEFAULT NULL COMMENT \'部门ID\',\n  `tenant_id` int(11) DEFAULT NULL COMMENT \'租户\',\n  `risk_type` enum(\'EVALUATION_FORM\',\'EXPERT_MODEL\') DEFAULT \'EXPERT_MODEL\' COMMENT \'风控类型(评分表/专家模型)\',\n  `strategy_type` tinyint(1) DEFAULT \'0\' COMMENT \'true   覆盖性决策,否则为漏斗形 \',\n  `score` int(4) DEFAULT \'100\' COMMENT \'总分 默认 100\',\n  `del_flag` tinyint(1) DEFAULT \'0\' COMMENT \'逻辑删除 1是 0 否\',\n  `version` varchar(30) DEFAULT NULL COMMENT \'版本号\',\n  `allocation` tinyint(1) DEFAULT \'1\' COMMENT \'下级节点分配类型\',\n  PRIMARY KEY (`id`) USING BTREE\n) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8mb4 COMMENT=\'风控管理\'', '[]', '[]', 0);
INSERT INTO `datasource_table` VALUES ('bfe1e3d200f6000f8b7f4870f5e8ee8e', 'sys_system', '系统管理', 'd18edef4341edbf3970a4d0b823204bd', 'jvs', 1, '2021-09-24 10:58:41', NULL, '2021-09-24 10:58:41', NULL, NULL, 'CREATE TABLE `sys_system` (\n  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,\n  `sys_name` varchar(64) NOT NULL COMMENT \'系统名\',\n  `sort` int(11) DEFAULT NULL COMMENT \'排序\',\n  `icon` varchar(255) DEFAULT NULL COMMENT \'Icon\',\n  `new_window` tinyint(1) NOT NULL DEFAULT \'0\' COMMENT \'是否新窗口打开\',\n  `external_system` tinyint(1) NOT NULL DEFAULT \'0\' COMMENT \'是否为外部系统\',\n  `address` varchar(255) DEFAULT NULL COMMENT \'回调地址\',\n  `security_key` varchar(64) DEFAULT NULL COMMENT \'密钥\',\n  `tenant_id` int(11) DEFAULT NULL COMMENT \'租户id\',\n  `from_id` int(11) DEFAULT NULL COMMENT \'来源ID\',\n  PRIMARY KEY (`id`) USING BTREE,\n  UNIQUE KEY `sys_name` (`sys_name`,`tenant_id`) USING BTREE\n) ENGINE=InnoDB AUTO_INCREMENT=35 DEFAULT CHARSET=utf8mb4 COMMENT=\'系统管理\'', '[{\"indexStyle\":\"UNIQUE\",\"indexName\":\"sys_name\",\"indexFieldIdOrName\":[\"sys_name\",\"tenant_id\"],\"indexComment\":\"\",\"indexType\":\"BTREE\"}]', '[]', 0);
INSERT INTO `datasource_table` VALUES ('c04caf4cfa990b9c864ff36fd8a6f5ae', 'sys_user', '用户表', 'd18edef4341edbf3970a4d0b823204bd', 'jvs', 1, '2021-09-24 10:58:42', NULL, '2021-09-24 10:58:42', NULL, NULL, 'CREATE TABLE `sys_user` (\n  `id` char(50) COLLATE utf8mb4_bin NOT NULL COMMENT \'主键ID\',\n  `real_name` varchar(255) COLLATE utf8mb4_bin DEFAULT NULL COMMENT \'用户真名\',\n  `user_type` int(1) DEFAULT \'1\' COMMENT \'用户类型。\\r\\n1、后端用户\\r\\n2、前端用户\\r\\n3、其它业务系统用户\',\n  `user_name` varchar(64) COLLATE utf8mb4_bin NOT NULL COMMENT \'用户名\',\n  `email` varchar(40) COLLATE utf8mb4_bin DEFAULT NULL COMMENT \'邮件\',\n  `nick_name` varchar(255) COLLATE utf8mb4_bin DEFAULT NULL COMMENT \'昵称\',\n  `head_img` varchar(255) COLLATE utf8mb4_bin DEFAULT NULL COMMENT \'头像\',\n  `password` varchar(255) COLLATE utf8mb4_bin NOT NULL COMMENT \'密码\',\n  `job_name` varchar(50) COLLATE utf8mb4_bin DEFAULT NULL COMMENT \'职位\',\n  `salt` varchar(255) COLLATE utf8mb4_bin DEFAULT NULL COMMENT \'随机盐\',\n  `phone` char(11) COLLATE utf8mb4_bin DEFAULT NULL COMMENT \'手机号\',\n  `dept_name` varchar(50) COLLATE utf8mb4_bin DEFAULT NULL COMMENT \'部门名称\',\n  `dept_id` char(50) COLLATE utf8mb4_bin DEFAULT NULL COMMENT \'部门ID\',\n  `create_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT \'创建时间\',\n  `update_time` timestamp NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT \'修改时间\',\n  `lock_flag` tinyint(1) DEFAULT \'0\' COMMENT \'0-正常，9-锁定\',\n  `del_flag` tinyint(1) DEFAULT \'0\' COMMENT \'0-正常，1-删除\',\n  `wx_extend` json DEFAULT NULL COMMENT \'微信扩展信息\',\n  `wx_openid` varchar(32) COLLATE utf8mb4_bin DEFAULT NULL COMMENT \'微信openid\',\n  `tenant_id` char(50) COLLATE utf8mb4_bin DEFAULT NULL COMMENT \'租户ID\',\n  `admin_flag` tinyint(1) DEFAULT \'0\' COMMENT \'是否是管理员(如果为管理员，则跳过部门数据权限过滤)\',\n  `data_authority` varchar(255) COLLATE utf8mb4_bin DEFAULT NULL COMMENT \'用户的数据权限\',\n  `job_id` char(50) COLLATE utf8mb4_bin DEFAULT NULL COMMENT \'岗位Id\',\n  `sex` varchar(11) COLLATE utf8mb4_bin DEFAULT \'male\' COMMENT \'性别 \',\n  `dept_leader` tinyint(1) DEFAULT \'0\' COMMENT \'是否是部门负责人\',\n  `hire_date` date DEFAULT NULL COMMENT \'入职日期\',\n  `employee_no` varchar(255) COLLATE utf8mb4_bin DEFAULT NULL COMMENT \'职工编号\',\n  `birthday` date DEFAULT NULL COMMENT \'生日\',\n  `level` int(11) DEFAULT NULL COMMENT \'账号等级\',\n  PRIMARY KEY (`id`) USING BTREE\n) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_bin COMMENT=\'用户表\'', '[]', '[]', 0);
INSERT INTO `datasource_table` VALUES ('c2d41817d4a2bad8cc56e06ed4c65e4b', 'lexin_module', '乐信模块配置表', 'd18edef4341edbf3970a4d0b823204bd', 'jvs', 1, '2021-09-24 10:58:33', NULL, '2021-09-24 10:58:33', NULL, NULL, 'CREATE TABLE `lexin_module` (\n  `id` char(50) COLLATE utf8_bin NOT NULL,\n  `product_tag` varchar(30) COLLATE utf8_bin DEFAULT NULL COMMENT \'产品标签\',\n  `product_name` varchar(50) COLLATE utf8_bin DEFAULT NULL COMMENT \'产品名\',\n  `merchant_id` varchar(50) COLLATE utf8_bin DEFAULT NULL COMMENT \'商户id\',\n  `api_key` bigint(50) DEFAULT NULL COMMENT \'接口授权key\',\n  `set_meal_no` varchar(100) COLLATE utf8_bin DEFAULT NULL COMMENT \'业务套餐号\',\n  `tenant_id` char(50) COLLATE utf8_bin DEFAULT NULL COMMENT \'租户id\',\n  PRIMARY KEY (`id`) USING BTREE\n) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin ROW_FORMAT=DYNAMIC COMMENT=\'乐信模块配置表\'', '[]', '[]', 0);
INSERT INTO `datasource_table` VALUES ('c3f082477d0ba36d616dc39728f548ca', 'lock_table', 'seata-lock-table', 'd18edef4341edbf3970a4d0b823204bd', 'jvs', 1, '2021-09-24 10:58:33', NULL, '2021-09-24 10:58:33', NULL, NULL, 'CREATE TABLE `lock_table` (\n  `row_key` varchar(128) NOT NULL,\n  `xid` varchar(128) DEFAULT NULL,\n  `transaction_id` bigint(20) DEFAULT NULL,\n  `branch_id` bigint(20) NOT NULL,\n  `resource_id` varchar(256) DEFAULT NULL,\n  `table_name` varchar(32) DEFAULT NULL,\n  `pk` varchar(36) DEFAULT NULL,\n  `gmt_create` datetime DEFAULT NULL,\n  `gmt_modified` datetime DEFAULT NULL,\n  PRIMARY KEY (`row_key`) USING BTREE,\n  KEY `idx_branch_id` (`branch_id`) USING BTREE\n) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT=\'seata-lock-table\'', '[{\"indexStyle\":\"NORMAL\",\"indexName\":\"idx_branch_id\",\"indexFieldIdOrName\":[\"branch_id\"],\"indexComment\":\"\",\"indexType\":\"BTREE\"}]', '[]', 0);
INSERT INTO `datasource_table` VALUES ('c5cfdb7686300882e4a3bfbd807ab197', 'chart_element', '组件图表', 'd18edef4341edbf3970a4d0b823204bd', 'jvs', 1, '2021-09-24 10:58:28', NULL, '2021-09-24 10:58:28', NULL, NULL, 'CREATE TABLE `chart_element` (\n  `id` char(50) NOT NULL,\n  `data_json` text COMMENT \'数据json\',\n  `chart_page_code` varchar(64) DEFAULT NULL COMMENT \'页面code\',\n  `tab_name` varchar(255) DEFAULT NULL COMMENT \'table页名称\',\n  `tenant_id` char(50) DEFAULT NULL COMMENT \'租户id\',\n  PRIMARY KEY (`id`) USING BTREE\n) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT=\'组件图表\'', '[]', '[]', 0);
INSERT INTO `datasource_table` VALUES ('c7f8bd49a5b12dfc6b515117bf3c9889', 'demo_student_copy1', 'demo_student_copy1', 'd18edef4341edbf3970a4d0b823204bd', 'jvs', 1, '2021-09-24 10:58:31', NULL, '2021-09-24 10:58:31', NULL, NULL, 'CREATE TABLE `demo_student_copy1` (\n  `id` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT \'id\',\n  `class_name` varchar(255) DEFAULT NULL COMMENT \'班级名称\',\n  `name` varchar(255) DEFAULT NULL COMMENT \'姓名\',\n  `gender` enum(\'MALE\',\'FEMALE\') DEFAULT NULL COMMENT \'性别\',\n  `age` int(11) DEFAULT NULL COMMENT \'年龄\',\n  `phone` varchar(255) DEFAULT NULL COMMENT \'家长联系电话\',\n  `id_card` varchar(255) DEFAULT NULL COMMENT \'身份证\',\n  `tenant_id` int(11) DEFAULT NULL COMMENT \'租户ID\',\n  `create_by` varchar(255) DEFAULT NULL COMMENT \'创建人\',\n  `update_by` varchar(50) DEFAULT NULL COMMENT \'修改人\',\n  `quota` int(255) DEFAULT NULL COMMENT \'售罄额度\',\n  `dept_id` int(11) DEFAULT NULL COMMENT \'部门ID\',\n  `job_id` int(11) DEFAULT NULL COMMENT \'岗位ID\',\n  `create_by_id` int(20) DEFAULT NULL COMMENT \'用户人ID\',\n  PRIMARY KEY (`id`) USING BTREE\n) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4', '[]', '[]', 0);
INSERT INTO `datasource_table` VALUES ('c8edff40dedd879e519d05ce912d7162', 'risk_log_batch_copy1', '日志主表', 'd18edef4341edbf3970a4d0b823204bd', 'jvs', 1, '2021-09-24 10:58:36', NULL, '2021-09-24 10:58:36', NULL, NULL, 'CREATE TABLE `risk_log_batch_copy1` (\n  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT \'主键\',\n  `no` varchar(35) NOT NULL COMMENT \'流水号\',\n  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT \'开始时间\',\n  `finish_time` timestamp NULL DEFAULT NULL COMMENT \'完成时间\',\n  `consuming_time` int(11) DEFAULT NULL COMMENT \'执行时间\',\n  `application_name` varchar(50) NOT NULL COMMENT \'应用名,如果是测试数据，则为自身risk-mgr\',\n  `parameters` json DEFAULT NULL COMMENT \'入参\',\n  `passing` int(11) DEFAULT NULL COMMENT \'通过率,失败的和成功的比例\',\n  `apis` json NOT NULL COMMENT \'根据设计获取此风控调用了哪些第三方接口API\',\n  `tenant_id` int(11) DEFAULT NULL COMMENT \'租户\',\n  `remark` varchar(200) DEFAULT NULL COMMENT \'备注\',\n  `error_msg` longtext COMMENT \'错误信息,整体的错误信息\',\n  `mode` tinyint(1) NOT NULL COMMENT \'是否为正式数据，还是测试数据\',\n  `project_name` varchar(50) NOT NULL COMMENT \'风控项名称\',\n  `price_sum` int(11) DEFAULT \'0\' COMMENT \'求总价,此次接口调用后的总价格\',\n  `phase` varchar(20) DEFAULT NULL COMMENT \'风控阶段(相当于备注使用，没有业务参与)\',\n  `project_no` varchar(40) DEFAULT NULL COMMENT \'编号\',\n  `count` int(11) DEFAULT NULL COMMENT \'总条数\',\n  `project_strategy` tinyint(1) DEFAULT NULL COMMENT \'决策类型  1 覆盖型, 0 漏斗型\',\n  `log_type` enum(\'STRATEGY_GROUP\',\'STRATEGY_FLOW\') DEFAULT \'STRATEGY_GROUP\' COMMENT \'日志类型  风控决策组日志,风控决策流日志\',\n  PRIMARY KEY (`id`) USING BTREE,\n  UNIQUE KEY `no` (`no`) USING BTREE\n) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 ROW_FORMAT=DYNAMIC COMMENT=\'日志主表\'', '[{\"indexStyle\":\"UNIQUE\",\"indexName\":\"no\",\"indexFieldIdOrName\":[\"no\"],\"indexComment\":\"\",\"indexType\":\"BTREE\"}]', '[]', 0);
INSERT INTO `datasource_table` VALUES ('c931f22ea1770fcc0ca55c01af9c84d7', 'demo_test', 'demo_test', 'd18edef4341edbf3970a4d0b823204bd', 'jvs', 1, '2021-09-24 10:58:31', NULL, '2021-09-24 10:58:31', NULL, NULL, 'CREATE TABLE `demo_test` (\n  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT \'id\',\n  `name` varchar(20) DEFAULT NULL COMMENT \'姓名\',\n  `age` int(3) DEFAULT NULL COMMENT \'年龄\',\n  PRIMARY KEY (`id`) USING BTREE\n) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4', '[]', '[]', 0);
INSERT INTO `datasource_table` VALUES ('d35f017806d1125f313b2b3fb570a2b8', 'dc_library_read_comment', '知识库-用户留言', 'd18edef4341edbf3970a4d0b823204bd', 'jvs', 1, '2021-09-24 10:58:30', NULL, '2021-09-24 10:58:30', NULL, NULL, 'CREATE TABLE `dc_library_read_comment` (\n  `id` int(20) NOT NULL AUTO_INCREMENT COMMENT \'主键\',\n  `name` varchar(128) DEFAULT NULL COMMENT \'用户名\',\n  `create_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT \'创建时间\',\n  `message` longtext COMMENT \'留言\',\n  `knowledge_id` int(11) DEFAULT NULL COMMENT \'知识库id\',\n  `tenant_id` int(11) DEFAULT NULL COMMENT \'租户\',\n  `parent_id` int(11) DEFAULT NULL COMMENT \'上级评论\',\n  PRIMARY KEY (`id`) USING BTREE\n) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT=\'知识库-用户留言\'', '[]', '[]', 0);
INSERT INTO `datasource_table` VALUES ('d4f6f87b53edde30239434127eb8717c', 'sys_permission', '资源数据表，用于统计所有项目的请求地址', 'd18edef4341edbf3970a4d0b823204bd', 'jvs', 1, '2021-09-24 10:58:40', NULL, '2021-09-24 10:58:40', NULL, NULL, 'CREATE TABLE `sys_permission` (\n  `id` char(50) NOT NULL COMMENT \'主键\',\n  `permission` varchar(255) DEFAULT NULL COMMENT \'资源标识(随机生成-建议使用中文名称进行拼音生成以_分割) 如果添加了忽略字段集，则直接放开即可,如果删除了，会生成uuid进行占位\',\n  `name` varchar(50) DEFAULT NULL COMMENT \'资源名称(为Swagger的注解名，或前端的按钮|资源名称)\',\n  `api` varchar(255) DEFAULT NULL COMMENT \'请求地址\',\n  `auth_ignore` tinyint(1) unsigned zerofill DEFAULT \'0\' COMMENT \'是否忽略权限\',\n  `method` char(10) DEFAULT NULL COMMENT \'请求方法\',\n  `module` varchar(50) DEFAULT NULL COMMENT \'模块名\',\n  `client_name` varchar(50) DEFAULT NULL COMMENT \'客户端或服务端名称\',\n  `type` enum(\'system\',\'custom\') DEFAULT \'system\' COMMENT \'系统加载资源，自定义资源\',\n  `delete_time` datetime DEFAULT NULL COMMENT \'自动识别删除时间（可手动删除此数据或批量删除此数据，真删除）\',\n  `menu_id` char(50) DEFAULT NULL COMMENT \'将资源挂在菜单上（不能挂一级菜单）\',\n  `tenant_id` char(50) DEFAULT \'1\' COMMENT \'租户ID默认1\',\n  `authority` tinyint(1) unsigned zerofill DEFAULT \'1\' COMMENT \'是否显示资源\',\n  PRIMARY KEY (`id`) USING BTREE,\n  UNIQUE KEY `permission` (`permission`,`tenant_id`,`client_name`) USING BTREE COMMENT \'同一客户端，唯一标识，不能重复\'\n) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT=\'资源数据表，用于统计所有项目的请求地址\'', '[{\"indexStyle\":\"UNIQUE\",\"indexName\":\"permission\",\"indexFieldIdOrName\":[\"permission\",\"tenant_id\",\"client_name\"],\"indexComment\":\"同一客户端，唯一标识，不能重复\",\"indexType\":\"BTREE\"}]', '[]', 0);
INSERT INTO `datasource_table` VALUES ('d7e365d8207d358019250c5fc8da5fde', 'sys_user_login_log', '逻辑定义数据', 'd18edef4341edbf3970a4d0b823204bd', 'jvs', 1, '2021-09-24 10:58:42', NULL, '2021-09-24 10:58:42', NULL, NULL, 'CREATE TABLE `sys_user_login_log` (\n  `id` char(50) NOT NULL COMMENT \'主键\',\n  `user_id` char(50) DEFAULT NULL COMMENT \'用户id\',\n  `user_name` varchar(255) DEFAULT NULL COMMENT \'用户名\',\n  `type` varchar(255) DEFAULT \'LOGIN\' COMMENT \'类型\',\n  `ip` varchar(255) DEFAULT NULL COMMENT \'ip地址\',\n  `operate_time` datetime DEFAULT NULL COMMENT \'操作时间\',\n  `device` varchar(255) DEFAULT NULL COMMENT \'设备\',\n  `user_agent` varchar(999) DEFAULT NULL COMMENT \'请求标识头\',\n  `remark` varchar(255) DEFAULT NULL COMMENT \'备注\',\n  `tenant_id` char(50) DEFAULT NULL COMMENT \'租户ID\',\n  `del_flag` tinyint(1) DEFAULT \'0\' COMMENT \'逻辑删除\',\n  `status` tinyint(1) DEFAULT \'1\' COMMENT \'登录成功状态\',\n  `login_type` varchar(255) DEFAULT NULL COMMENT \'登录方式\',\n  PRIMARY KEY (`id`) USING BTREE\n) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT=\'逻辑定义数据\'', '[]', '[]', 0);
INSERT INTO `datasource_table` VALUES ('d967416b48aa68d5ee155948d59aa40a', 't_grade', '年级', 'd18edef4341edbf3970a4d0b823204bd', 'jvs', 1, '2021-09-24 10:58:43', NULL, '2021-09-24 10:58:43', NULL, NULL, 'CREATE TABLE `t_grade` (\n  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT \'ID\',\n  `school_id` int(11) NOT NULL COMMENT \'校园ID\',\n  `name` varchar(255) DEFAULT NULL COMMENT \'年级名称\',\n  `person_num` int(3) DEFAULT NULL COMMENT \'总人数\',\n  `note` text COMMENT \'备注信息\',\n  `create_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT \'创建时间\',\n  `update_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT \'更新时间\',\n  `create_by` varchar(40) DEFAULT NULL COMMENT \'创建人\',\n  `update_by` varchar(40) DEFAULT NULL COMMENT \'更新人\',\n  `tenant_id` int(11) NOT NULL DEFAULT \'1\' COMMENT \'所属租户\',\n  `del_flag` char(1) DEFAULT \'0\' COMMENT \'删除状态\',\n  PRIMARY KEY (`id`) USING BTREE\n) ENGINE=InnoDB AUTO_INCREMENT=49 DEFAULT CHARSET=utf8mb4 COMMENT=\'年级\'', '[]', '[]', 0);
INSERT INTO `datasource_table` VALUES ('dbdb7fb719bcee1b79f1826b8d65e696', 'risk_log', '日志子表', 'd18edef4341edbf3970a4d0b823204bd', 'jvs', 1, '2021-09-24 10:58:36', NULL, '2021-09-24 10:58:36', NULL, NULL, 'CREATE TABLE `risk_log` (\n  `id` char(50) NOT NULL COMMENT \'主键\',\n  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT \'开始时间\',\n  `finish_time` timestamp NULL DEFAULT NULL COMMENT \'完成时间\',\n  `consuming_time` int(11) DEFAULT NULL COMMENT \'执行时间\',\n  `parameters` json NOT NULL COMMENT \'入参\',\n  `result` varchar(255) DEFAULT \'\' COMMENT \'风控执行结果\',\n  `error_msg` longtext COMMENT \'执行错误信息\',\n  `no` varchar(20) NOT NULL COMMENT \'批次号,一次可能会执行多个数据批次号一样\',\n  `tenant_id` char(50) DEFAULT NULL COMMENT \'租户\',\n  `remark` varchar(200) DEFAULT NULL COMMENT \'备注\',\n  `state` tinyint(1) NOT NULL DEFAULT \'0\' COMMENT \'是否完整运行\',\n  `price_sum` int(11) DEFAULT \'0\' COMMENT \'求总价,此次风控实际价格\',\n  `apis` varchar(999) DEFAULT NULL COMMENT \'根据设计获取此风控调用了哪些第三方接口API\',\n  `reason` varchar(3999) DEFAULT NULL COMMENT \'不通过原因\',\n  `model_json` json DEFAULT NULL COMMENT \'节点树执行的测试结果\',\n  `create_by` varchar(255) DEFAULT NULL COMMENT \'操作人\',\n  `log_type` enum(\'STRATEGY_GROUP\',\'STRATEGY_FLOW\') DEFAULT \'STRATEGY_GROUP\',\n  PRIMARY KEY (`id`) USING BTREE\n) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT=\'日志子表\'', '[]', '[]', 0);
INSERT INTO `datasource_table` VALUES ('de961c905e5c47fd1a5a3d4ac67e3830', 'datasource_table_fields', '表字段的解释', 'd18edef4341edbf3970a4d0b823204bd', 'jvs', 1, '2021-09-24 10:58:29', NULL, '2021-09-24 10:58:29', NULL, NULL, 'CREATE TABLE `datasource_table_fields` (\n  `id` char(50) NOT NULL COMMENT \'主键\',\n  `table_name` varchar(60) DEFAULT NULL COMMENT \'表名称\',\n  `table_id` char(50) NOT NULL COMMENT \'关联是某一张表的数据\',\n  `column_name` varchar(64) DEFAULT NULL COMMENT \'列名\',\n  `column_default` longtext COMMENT \'默认值\',\n  `is_nullable` varchar(3) DEFAULT NULL COMMENT \'是否为空\',\n  `data_type` varchar(10) DEFAULT NULL COMMENT \'字段类型\',\n  `character_maximum_length` bigint(21) DEFAULT NULL COMMENT \'字符最大长度\',\n  `numeric_precision` bigint(21) DEFAULT NULL COMMENT \'数值精度(最大位数)\',\n  `numeric_scale` bigint(21) DEFAULT NULL COMMENT \'小数精度\',\n  `column_type` longtext COMMENT \'列类型\',\n  `column_key` char(3) DEFAULT NULL COMMENT \'是否是主键\',\n  `extra` varchar(30) DEFAULT NULL COMMENT \'额外说明\',\n  `ordinal_position` bigint(21) DEFAULT NULL COMMENT \'排序\',\n  `column_comment` varchar(1024) DEFAULT NULL COMMENT \'注释\',\n  `tenant_id` char(50) DEFAULT NULL COMMENT \'租户\',\n  `foreign_key` text COMMENT \'关联\',\n  PRIMARY KEY (`id`) USING BTREE,\n  UNIQUE KEY `UNIQ_TB_FIELD` (`table_id`,`column_name`) USING BTREE,\n  KEY `table_name` (`table_name`) USING BTREE\n) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT=\'表字段的解释\'', '[{\"indexStyle\":\"UNIQUE\",\"indexName\":\"UNIQ_TB_FIELD\",\"indexFieldIdOrName\":[\"table_id\",\"column_name\"],\"indexComment\":\"\",\"indexType\":\"BTREE\"},{\"indexStyle\":\"NORMAL\",\"indexName\":\"table_name\",\"indexFieldIdOrName\":[\"table_name\"],\"indexComment\":\"\",\"indexType\":\"BTREE\"}]', '[]', 0);
INSERT INTO `datasource_table` VALUES ('e13f462cd20ff67de774b1c704cc8f12', 'sys_message_user_log', '站内信用户消息', 'd18edef4341edbf3970a4d0b823204bd', 'jvs', 1, '2021-09-24 10:58:40', NULL, '2021-09-24 10:58:40', NULL, NULL, 'CREATE TABLE `sys_message_user_log` (\n  `id` char(50) NOT NULL COMMENT \'主建\',\n  `user_id` char(50) DEFAULT NULL COMMENT \'用户ID\',\n  `read_status` tinyint(1) DEFAULT \'0\' COMMENT \'读取状态,默认未读\',\n  `read_time` timestamp NULL DEFAULT NULL COMMENT \'读取时间\',\n  `title` varchar(255) NOT NULL COMMENT \'标题\',\n  `content` longtext NOT NULL COMMENT \'内容\',\n  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT \'时间\',\n  `hide` tinyint(1) NOT NULL DEFAULT \'0\' COMMENT \'是否隐藏,默认显示\',\n  `source` varchar(255) DEFAULT NULL COMMENT \'消息来源,默认系统发送为系统,人工发送为某个人\',\n  `tenant_id` char(50) NOT NULL DEFAULT \'1\' COMMENT \'租户\',\n  `send_message_type` enum(\'broadcast\',\'warning\',\'notification\',\'system\',\'business\') DEFAULT NULL COMMENT \'消息类型： 广播消息\\\\警告消息\\\\通知消息\\\\系统消息\\\\业务消息\',\n  PRIMARY KEY (`id`) USING BTREE,\n  KEY `user_id` (`user_id`,`read_status`,`hide`,`send_message_type`) USING BTREE\n) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT=\'站内信用户消息\'', '[{\"indexStyle\":\"NORMAL\",\"indexName\":\"user_id\",\"indexFieldIdOrName\":[\"user_id\",\"read_status\",\"hide\",\"send_message_type\"],\"indexComment\":\"\",\"indexType\":\"BTREE\"}]', '[]', 0);
INSERT INTO `datasource_table` VALUES ('e3e570b98b10effeddf76229229e66d0', 'pay_channel', '支付渠道表', 'd18edef4341edbf3970a4d0b823204bd', 'jvs', 1, '2021-09-24 10:58:34', NULL, '2021-09-24 10:58:34', NULL, NULL, 'CREATE TABLE `pay_channel` (\n  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT \'渠道主键ID\',\n  `channel_id` varchar(24) NOT NULL COMMENT \'渠道ID\',\n  `channel_name` varchar(30) NOT NULL COMMENT \'渠道名称,如:alipay,wechat\',\n  `channel_mch_id` varchar(32) NOT NULL COMMENT \'渠道商户ID\',\n  `status` tinyint(6) NOT NULL DEFAULT \'1\' COMMENT \'渠道状态,0-停用,1-启用\',\n  `remark` varchar(128) DEFAULT NULL COMMENT \'备注\',\n  `create_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT \'创建时间\',\n  `update_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT \'更新时间\',\n  `del_flag` tinyint(1) DEFAULT \'0\' COMMENT \'0-正常，1-删除\',\n  `tenant_id` int(11) DEFAULT NULL COMMENT \'租户ID\',\n  PRIMARY KEY (`id`) USING BTREE,\n  UNIQUE KEY `uk_tenant_id_channel_id` (`tenant_id`,`channel_id`) USING BTREE\n) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT=\'支付渠道表\'', '[{\"indexStyle\":\"UNIQUE\",\"indexName\":\"uk_tenant_id_channel_id\",\"indexFieldIdOrName\":[\"tenant_id\",\"channel_id\"],\"indexComment\":\"\",\"indexType\":\"BTREE\"}]', '[]', 0);
INSERT INTO `datasource_table` VALUES ('e52d509d2873097bb4228cbb9bc7bd3b', 'global_table', 'seata-global-table', 'd18edef4341edbf3970a4d0b823204bd', 'jvs', 1, '2021-09-24 10:58:32', NULL, '2021-09-24 10:58:32', NULL, NULL, 'CREATE TABLE `global_table` (\n  `xid` varchar(128) NOT NULL,\n  `transaction_id` bigint(20) DEFAULT NULL,\n  `status` tinyint(4) NOT NULL,\n  `application_id` varchar(32) DEFAULT NULL,\n  `transaction_service_group` varchar(32) DEFAULT NULL,\n  `transaction_name` varchar(128) DEFAULT NULL,\n  `timeout` int(11) DEFAULT NULL,\n  `begin_time` bigint(20) DEFAULT NULL,\n  `application_data` varchar(2000) DEFAULT NULL,\n  `gmt_create` datetime DEFAULT NULL,\n  `gmt_modified` datetime DEFAULT NULL,\n  PRIMARY KEY (`xid`) USING BTREE,\n  KEY `idx_gmt_modified_status` (`gmt_modified`,`status`) USING BTREE,\n  KEY `idx_transaction_id` (`transaction_id`) USING BTREE\n) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT=\'seata-global-table\'', '[{\"indexStyle\":\"NORMAL\",\"indexName\":\"idx_transaction_id\",\"indexFieldIdOrName\":[\"transaction_id\"],\"indexComment\":\"\",\"indexType\":\"BTREE\"},{\"indexStyle\":\"NORMAL\",\"indexName\":\"idx_gmt_modified_status\",\"indexFieldIdOrName\":[\"gmt_modified\",\"status\"],\"indexComment\":\"\",\"indexType\":\"BTREE\"}]', '[]', 0);
INSERT INTO `datasource_table` VALUES ('e7982898dcfd0f776f1d964ef18dcab7', 'hr_pro_member', '人力资源-项目成员', 'd18edef4341edbf3970a4d0b823204bd', 'jvs', 1, '2021-09-24 10:58:32', NULL, '2021-09-24 10:58:32', NULL, NULL, 'CREATE TABLE `hr_pro_member` (\n  `id` int(11) NOT NULL COMMENT \'团队id\',\n  `name` text COMMENT \'成员名称\',\n  `creator` varchar(255) DEFAULT NULL COMMENT \'创建人\',\n  `status` varchar(255) DEFAULT NULL COMMENT \'成员状态\',\n  `join_time` datetime DEFAULT NULL COMMENT \'加入时间\',\n  `pro_id` int(11) DEFAULT NULL COMMENT \'所属项目\',\n  `role_name` varchar(255) DEFAULT NULL COMMENT \'成员角色\',\n  `user_id` varchar(255) DEFAULT NULL COMMENT \'成员id\',\n  PRIMARY KEY (`id`) USING BTREE\n) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 ROW_FORMAT=DYNAMIC COMMENT=\'人力资源-项目成员\'', '[]', '[]', 0);
INSERT INTO `datasource_table` VALUES ('ec090a5b045f11a6880b6881c881ab27', 'demo_student', '学生', 'd18edef4341edbf3970a4d0b823204bd', 'jvs', 1, '2021-09-24 10:58:31', NULL, '2021-09-24 10:58:31', NULL, NULL, 'CREATE TABLE `demo_student` (\n  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT \'ID\',\n  `class_name` varchar(255) NOT NULL COMMENT \'班级ID\',\n  `name` varchar(255) DEFAULT NULL COMMENT \'姓名\',\n  `gender` enum(\'MALE\',\'FEMALE\') DEFAULT NULL COMMENT \'性别\',\n  `age` int(3) DEFAULT NULL COMMENT \'年龄\',\n  `birthday` date DEFAULT NULL COMMENT \'生日\',\n  `id_card` char(18) DEFAULT NULL COMMENT \'身份证\',\n  `note` text COMMENT \'备注信息\',\n  `create_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT \'创建时间\',\n  `update_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT \'更新时间\',\n  `create_by` varchar(40) DEFAULT NULL COMMENT \'创建人\',\n  `update_by` varchar(40) DEFAULT NULL COMMENT \'更新人\',\n  `tenant_id` int(11) NOT NULL DEFAULT \'1\' COMMENT \'所属租户\',\n  `job_id` varchar(40) DEFAULT NULL COMMENT \'岗位ID\',\n  `create_by_id` int(11) DEFAULT NULL COMMENT \'创建人id\',\n  `del_flag` char(1) DEFAULT \'0\' COMMENT \'删除状态\',\n  `dept_id` varchar(40) DEFAULT NULL COMMENT \'权限部门\',\n  PRIMARY KEY (`id`) USING BTREE\n) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT=\'学生\'', '[]', '[]', 0);
INSERT INTO `datasource_table` VALUES ('ec8cae77c9bba231df265d4bc327e733', 'im_notify_message', 'IM通知全量消息表', 'd18edef4341edbf3970a4d0b823204bd', 'jvs', 1, '2021-09-24 10:58:33', NULL, '2021-09-24 10:58:33', NULL, NULL, 'CREATE TABLE `im_notify_message` (\n  `id` char(50) COLLATE utf8mb4_bin NOT NULL COMMENT \'主键ID\',\n  `notify_type` tinyint(1) NOT NULL COMMENT \'0-广播，1-组通知，2-精确通知\',\n  `from_user_id` char(50) COLLATE utf8mb4_bin NOT NULL DEFAULT \'0\' COMMENT \'发送消息用户id(若是系统发送，则默认为0)\',\n  `group_ids` json DEFAULT NULL COMMENT \'目标群组id(JSON数组)\',\n  `user_ids` json DEFAULT NULL COMMENT \'目标用户id(JSON数组)\',\n  `message` json NOT NULL COMMENT \'聊天消息体\',\n  `create_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT \'创建时间\',\n  `update_time` timestamp NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT \'修改时间\',\n  `del_flag` tinyint(1) DEFAULT \'0\' COMMENT \'0-正常，1-删除\',\n  `tenant_id` char(50) COLLATE utf8mb4_bin DEFAULT NULL COMMENT \'租户ID\',\n  PRIMARY KEY (`id`) USING BTREE,\n  KEY `idx_notify_type` (`notify_type`) USING BTREE,\n  KEY `idx_from_user_id` (`from_user_id`) USING BTREE,\n  KEY `idx_tenant_id` (`tenant_id`) USING BTREE\n) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_bin COMMENT=\'IM通知全量消息表\'', '[{\"indexStyle\":\"NORMAL\",\"indexName\":\"idx_notify_type\",\"indexFieldIdOrName\":[\"notify_type\"],\"indexComment\":\"\",\"indexType\":\"BTREE\"},{\"indexStyle\":\"NORMAL\",\"indexName\":\"idx_from_user_id\",\"indexFieldIdOrName\":[\"from_user_id\"],\"indexComment\":\"\",\"indexType\":\"BTREE\"},{\"indexStyle\":\"NORMAL\",\"indexName\":\"idx_tenant_id\",\"indexFieldIdOrName\":[\"tenant_id\"],\"indexComment\":\"\",\"indexType\":\"BTREE\"}]', '[]', 0);
INSERT INTO `datasource_table` VALUES ('eeee0e94fc75726ad2ac5c7cece2431a', 'sys_message', '消息发送日志', 'd18edef4341edbf3970a4d0b823204bd', 'jvs', 1, '2021-09-24 10:58:40', NULL, '2021-09-24 10:58:40', NULL, NULL, 'CREATE TABLE `sys_message` (\n  `id` char(50) NOT NULL COMMENT \'主键\',\n  `send_type` enum(\'sms\',\'email\',\'interior\') DEFAULT NULL COMMENT \'发送类型\\\\短信\\\\邮件\\\\站内信\',\n  `send_message_type` enum(\'broadcast\',\'warning\',\'notification\',\'system\',\'business\') DEFAULT NULL COMMENT \'消息类型： 广播消息\\\\警告消息\\\\通知消息\\\\系统消息\\\\业务消息\',\n  `status` tinyint(5) unsigned NOT NULL DEFAULT \'2\' COMMENT \'发送状态(0失败;1成功;2未发送;3发送中)\',\n  `send_count` int(11) unsigned NOT NULL DEFAULT \'0\' COMMENT \'消息成功发送次数\',\n  `title` varchar(255) DEFAULT NULL COMMENT \'标题\',\n  `source` varchar(255) DEFAULT NULL COMMENT \'消息来源\',\n  `content` longtext COMMENT \'发送内容,如果是邮件和站内信，支持html标签功能\',\n  `recipients` json DEFAULT NULL COMMENT \'批量收件人,最多500个，多余500会切分，可能是用户id，可能是用户手机号\',\n  `other` text COMMENT \'发送返回信息,邮件和短信发送的消息\',\n  `create_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT \'发送时间\',\n  `extension` json DEFAULT NULL COMMENT \'用于业务扩展字段方便排查问题\',\n  `business_id` char(50) DEFAULT NULL COMMENT \'业务id\',\n  `business_name` varchar(255) DEFAULT NULL COMMENT \'业务系统,如果业务系统需要发送站内信，直接使用mq-core进行发送即可查收\',\n  `tenant_id` char(50) DEFAULT NULL COMMENT \'租户\',\n  `flag` tinyint(1) DEFAULT \'0\' COMMENT \'逻辑删除\',\n  PRIMARY KEY (`id`) USING BTREE\n) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT=\'消息发送日志\'', '[]', '[]', 0);
INSERT INTO `datasource_table` VALUES ('f52bf6ed297228f119aa10809a98452c', 'pay_alipay', '支付宝配置', 'd18edef4341edbf3970a4d0b823204bd', 'jvs', 1, '2021-09-24 10:58:34', NULL, '2021-09-24 10:58:34', NULL, NULL, 'CREATE TABLE `pay_alipay` (\n  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT \'主键ID\',\n  `app_id` varchar(64) COLLATE utf8mb4_bin NOT NULL COMMENT \'应用ID\',\n  `sign_mode` tinyint(1) NOT NULL COMMENT \'加签模式（1-公钥证书,2-公钥）\',\n  `merchant_private_key` text COLLATE utf8mb4_bin NOT NULL COMMENT \'应用私钥\',\n  `ali_pay_public_key` text COLLATE utf8mb4_bin COMMENT \'支付宝公钥\',\n  `notify_url` varchar(1024) COLLATE utf8mb4_bin DEFAULT NULL COMMENT \'异步通知回调地址(支付系统回调业务系统的地址)\',\n  `merchant_cert` blob COMMENT \'应用公钥证书\',\n  `alipay_cert` blob COMMENT \'支付宝公钥证书\',\n  `alipay_root_cert` blob COMMENT \'支付宝根证书\',\n  `create_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT \'创建时间\',\n  `update_time` timestamp NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT \'修改时间\',\n  `del_flag` tinyint(1) DEFAULT \'0\' COMMENT \'0-正常，1-删除\',\n  `tenant_id` int(11) NOT NULL COMMENT \'租户ID\',\n  PRIMARY KEY (`id`) USING BTREE\n) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_bin COMMENT=\'支付宝配置\'', '[]', '[]', 0);
INSERT INTO `datasource_table` VALUES ('f73b40bc113c3bb4fa22a5139e6be62c', 'sys_sql', 'SQL执行记录', 'd18edef4341edbf3970a4d0b823204bd', 'jvs', 1, '2021-09-24 10:58:41', NULL, '2021-09-24 10:58:41', NULL, NULL, 'CREATE TABLE `sys_sql` (\n  `id` char(50) NOT NULL COMMENT \'主键\',\n  `application_name` varchar(40) DEFAULT NULL COMMENT \'服务名\',\n  `executed_sql` text COMMENT \'执行SQL\',\n  `start_time` timestamp NULL DEFAULT NULL COMMENT \'执行时间\',\n  `end_time` timestamp NULL DEFAULT NULL COMMENT \'结束时间\',\n  `consuming_time` int(2) DEFAULT NULL COMMENT \'消耗时间\',\n  `tenant_id` char(50) DEFAULT \'1\' COMMENT \'租户ID默认1\',\n  `slow_sql` tinyint(1) DEFAULT NULL COMMENT \'是否是慢sql\',\n  `access_type` varchar(255) DEFAULT NULL COMMENT \'访问类型\',\n  PRIMARY KEY (`id`) USING BTREE,\n  KEY `application_name` (`application_name`,`tenant_id`) USING BTREE\n) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT=\'SQL执行记录\'', '[{\"indexStyle\":\"NORMAL\",\"indexName\":\"application_name\",\"indexFieldIdOrName\":[\"application_name\",\"tenant_id\"],\"indexComment\":\"\",\"indexType\":\"BTREE\"}]', '[]', 0);
