create database `jvs` default character set utf8mb4 collate utf8mb4_general_ci;
use jvs;
SET NAMES utf8mb4;
SET FOREIGN_KEY_CHECKS = 0;

-- ----------------------------
-- Table structure for chart_component
-- ----------------------------
DROP TABLE IF EXISTS `chart_component`;
CREATE TABLE `chart_component` (
  `id` char(50) NOT NULL,
  `component_json` json DEFAULT NULL COMMENT '数据json',
  `type` enum('LineChart','HistogramChart','BarChart','Pie','ScatterChart','FunnelChart','AreaChart','DashBoardChart','DataCard','InfoCard','') DEFAULT NULL COMMENT '组件',
  `page_id` char(50) DEFAULT NULL COMMENT '数据ID',
  `tenant_id` char(50) DEFAULT NULL COMMENT '租户id',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT='组件图表';

-- ----------------------------
-- Records of chart_component
-- ----------------------------
BEGIN;
COMMIT;

-- ----------------------------
-- Table structure for chart_page
-- ----------------------------
DROP TABLE IF EXISTS `chart_page`;
CREATE TABLE `chart_page` (
  `id` char(50) NOT NULL COMMENT '主键',
  `name` varchar(20) DEFAULT NULL COMMENT '名称',
  `privilege_type` enum('all','interior','assign') DEFAULT NULL COMMENT '    all("all", "所有人"),\r\n    interior("interior", "内部"),\r\n    assign("assign", "指定人");',
  `refresh_time` int(2) DEFAULT NULL COMMENT '刷新时间',
  `is_deploy` tinyint(1) DEFAULT '0' COMMENT '发布状态',
  `create_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_time` datetime DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  `create_by` varchar(40) DEFAULT NULL COMMENT '创建人',
  `update_by` varchar(40) DEFAULT NULL COMMENT '更新人',
  `tenant_id` char(50) NOT NULL DEFAULT '1' COMMENT '所属租户',
  `del_flag` char(1) DEFAULT '0' COMMENT '删除状态',
  `dept_id` char(50) DEFAULT NULL COMMENT '部门ID',
  `create_by_id` char(50) DEFAULT NULL COMMENT '创建人',
  `description` varchar(64) DEFAULT NULL COMMENT '描述',
  `job_id` char(50) DEFAULT NULL COMMENT '岗位ID',
  `filter_json` json DEFAULT NULL COMMENT '筛选条件',
  `data_json` json DEFAULT NULL COMMENT '数据json',
  `supported_client_type` enum('all','pc','mobile') DEFAULT NULL COMMENT '多端支持',
  `check_login` tinyint(1) DEFAULT '1' COMMENT '是否校验登录',
  `icon` varchar(512) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL COMMENT '图标',
  `project_name` varchar(50) DEFAULT NULL,
  `project_id` char(50) DEFAULT NULL COMMENT '项目ID',
  `type` varchar(60) DEFAULT NULL COMMENT '分类',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT='页面配置';

-- ----------------------------
-- Records of chart_page
-- ----------------------------
BEGIN;
COMMIT;

-- ----------------------------
-- Table structure for crud_flowable_form_field
-- ----------------------------
DROP TABLE IF EXISTS `crud_flowable_form_field`;
CREATE TABLE `crud_flowable_form_field` (
  `id` char(50) NOT NULL COMMENT '主键',
  `model_id` char(50) NOT NULL COMMENT '流程设计id',
  `node_id` char(50) NOT NULL COMMENT '节点id',
  `view_json` longtext COMMENT '渲染json',
  `tenant_id` char(50) DEFAULT NULL COMMENT '租户ID',
  `create_by` varchar(20) DEFAULT NULL COMMENT '创建人',
  `update_by` varchar(20) DEFAULT NULL COMMENT '修改人',
  `update_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '修改时间',
  `create_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `flag` tinyint(1) DEFAULT '0' COMMENT '是否删除',
  `dept_id` char(50) DEFAULT NULL COMMENT '部门ID',
  `job_id` char(50) DEFAULT NULL COMMENT '岗位ID',
  `create_by_id` char(50) DEFAULT NULL COMMENT '创建人',
  PRIMARY KEY (`id`) USING BTREE,
  KEY `UNI_MODEL_NODE` (`model_id`,`node_id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT='工作流字段设计';

-- ----------------------------
-- Records of crud_flowable_form_field
-- ----------------------------
BEGIN;
COMMIT;

-- ----------------------------
-- Table structure for crud_form
-- ----------------------------
DROP TABLE IF EXISTS `crud_form`;
CREATE TABLE `crud_form` (
  `id` char(50) NOT NULL COMMENT '主键',
  `name` varchar(300) NOT NULL COMMENT '表单唯一值',
  `enable` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否启用',
  `view_json` longtext COMMENT '渲染json',
  `type` enum('multiLevelForm','normalForm','detailForm','flowable','step') NOT NULL COMMENT '表单类型：多级，普通，详情，流程，步骤',
  `tenant_id` char(50) DEFAULT NULL COMMENT '租户ID',
  `create_by` varchar(20) DEFAULT NULL COMMENT '创建人',
  `update_by` varchar(20) DEFAULT NULL COMMENT '修改人',
  `update_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '修改时间',
  `create_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `flag` tinyint(1) DEFAULT '0' COMMENT '是否删除',
  `classify` varchar(64) DEFAULT NULL COMMENT '归类',
  `description` varchar(255) DEFAULT NULL COMMENT '表单描述',
  `is_deploy` tinyint(1) DEFAULT '0' COMMENT '是否部署',
  `chinese_name` varchar(64) DEFAULT NULL COMMENT '表单名称',
  `dept_id` char(50) DEFAULT NULL COMMENT '部门ID',
  `job_id` char(50) DEFAULT NULL COMMENT '岗位ID',
  `create_by_id` char(50) DEFAULT NULL COMMENT '创建人',
  `supported_client_type` enum('all','pc','mobile') DEFAULT NULL COMMENT '支持的客户端类型',
  `check_login` tinyint(1) DEFAULT '1' COMMENT '是否校验登录, 默认为true',
  `project_name` varchar(255) DEFAULT NULL COMMENT '项目名称',
  `project_id` char(50) DEFAULT NULL COMMENT '项目ID',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT='表单配置项';

-- ----------------------------
-- Records of crud_form
-- ----------------------------
BEGIN;
COMMIT;

-- ----------------------------
-- Table structure for crud_page
-- ----------------------------
DROP TABLE IF EXISTS `crud_page`;
CREATE TABLE `crud_page` (
  `id` char(50) NOT NULL COMMENT '主键',
  `name` varchar(64) NOT NULL COMMENT '页面名称',
  `type` varchar(60) DEFAULT NULL COMMENT '分类',
  `view_json` longtext COMMENT '渲染json',
  `tenant_id` char(50) DEFAULT NULL COMMENT '租户ID',
  `is_deploy` tinyint(1) DEFAULT '0' COMMENT '是否已发布',
  `create_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_time` datetime DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  `create_by` varchar(40) DEFAULT NULL COMMENT '创建人',
  `update_by` varchar(40) DEFAULT NULL COMMENT '更新人',
  `flag` char(1) DEFAULT '0' COMMENT '删除状态',
  `code` varchar(64) DEFAULT NULL COMMENT '唯一code',
  `description` varchar(64) DEFAULT NULL COMMENT '描述',
  `dept_id` char(50) DEFAULT NULL COMMENT '部门ID',
  `job_id` char(50) DEFAULT NULL COMMENT '岗位ID',
  `create_by_id` char(50) DEFAULT NULL COMMENT '创建人',
  `project_name` varchar(255) DEFAULT NULL COMMENT '项目名称',
  `project_id` char(50) DEFAULT NULL COMMENT '项目ID',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE KEY `code` (`code`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT='列表的列表配置项';

-- ----------------------------
-- Records of crud_page
-- ----------------------------
BEGIN;
COMMIT;

-- ----------------------------
-- Table structure for datasource_database
-- ----------------------------
DROP TABLE IF EXISTS `datasource_database`;
CREATE TABLE `datasource_database` (
  `id` char(50) NOT NULL COMMENT '主键',
  `name` varchar(50) NOT NULL COMMENT '名称',
  `port` varchar(20) DEFAULT NULL COMMENT '端口',
  `ip` varchar(20) DEFAULT NULL COMMENT '主机',
  `database_name` varchar(50) NOT NULL COMMENT '库名',
  `user_name` varchar(50) NOT NULL COMMENT '用户名',
  `pass_word` varchar(50) NOT NULL COMMENT '密码',
  `create_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `create_by` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL COMMENT '创建人',
  `update_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '修改时间',
  `update_by` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL COMMENT '修改人',
  `tenant_id` char(50) DEFAULT NULL COMMENT '租户',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE KEY `UNIQ_DB` (`database_name`,`tenant_id`) USING BTREE,
  KEY `name` (`name`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT='数据源配置项';

-- ----------------------------
-- Records of datasource_database
-- ----------------------------
BEGIN;
COMMIT;

-- ----------------------------
-- Table structure for datasource_table
-- ----------------------------
DROP TABLE IF EXISTS `datasource_table`;
CREATE TABLE `datasource_table` (
  `id` char(50) NOT NULL COMMENT '主键',
  `table_name` varchar(100) NOT NULL COMMENT '表英文名称',
  `info` varchar(200) NOT NULL COMMENT '说明',
  `data_source_id` char(50) DEFAULT NULL COMMENT '数据源ID',
  `data_source_name` varchar(100) DEFAULT NULL COMMENT '数据源解释',
  `data_source_load` tinyint(1) DEFAULT NULL COMMENT '是否数据源加载，如果是，则表示如果是数据源加载，则不允许有操作权限',
  `update_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '修改时间',
  `create_by` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL COMMENT '创建人',
  `create_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_by` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL COMMENT '修改人',
  `tenant_id` char(50) DEFAULT NULL COMMENT '租户',
  `create_table_ddl` text COMMENT '创建表语句',
  `indexs` text COMMENT '表的索引信息',
  `fields` text COMMENT '表的默认字段',
  `conflict` tinyint(1) DEFAULT '0' COMMENT '是否和物理库的表结构不一致有冲突',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE KEY `UNIQ_DB_TABLE` (`table_name`,`data_source_id`) USING BTREE,
  KEY `data_source_load` (`data_source_load`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT='表或视图管理';

-- ----------------------------
-- Records of datasource_table
-- ----------------------------
BEGIN;
COMMIT;

-- ----------------------------
-- Table structure for datasource_table_fields
-- ----------------------------
DROP TABLE IF EXISTS `datasource_table_fields`;
CREATE TABLE `datasource_table_fields` (
  `id` char(50) NOT NULL COMMENT '主键',
  `table_name` varchar(60) DEFAULT NULL COMMENT '表名称',
  `table_id` char(50) NOT NULL COMMENT '关联是某一张表的数据',
  `column_name` varchar(64) DEFAULT NULL COMMENT '列名',
  `column_default` longtext COMMENT '默认值',
  `is_nullable` varchar(3) DEFAULT NULL COMMENT '是否为空',
  `data_type` varchar(10) DEFAULT NULL COMMENT '字段类型',
  `character_maximum_length` bigint(21) DEFAULT NULL COMMENT '字符最大长度',
  `numeric_precision` bigint(21) DEFAULT NULL COMMENT '数值精度(最大位数)',
  `numeric_scale` bigint(21) DEFAULT NULL COMMENT '小数精度',
  `column_type` longtext COMMENT '列类型',
  `column_key` char(3) DEFAULT NULL COMMENT '是否是主键',
  `extra` varchar(30) DEFAULT NULL COMMENT '额外说明',
  `ordinal_position` bigint(21) DEFAULT NULL COMMENT '排序',
  `column_comment` varchar(1024) DEFAULT NULL COMMENT '注释',
  `tenant_id` char(50) DEFAULT NULL COMMENT '租户',
  `foreign_key` text COMMENT '关联',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE KEY `UNIQ_TB_FIELD` (`table_id`,`column_name`) USING BTREE,
  KEY `table_name` (`table_name`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT='表字段的解释';

-- ----------------------------
-- Records of datasource_table_fields
-- ----------------------------
BEGIN;
COMMIT;

-- ----------------------------
-- Table structure for dc_button_authority
-- ----------------------------
DROP TABLE IF EXISTS `dc_button_authority`;
CREATE TABLE `dc_button_authority` (
