-- ----------------------------
-- Table structure for dc_label
-- ----------------------------
DROP TABLE IF EXISTS `dc_label`;
CREATE TABLE `dc_label` (
  `id` char(50) NOT NULL COMMENT ' 标签',
  `name` varchar(50) DEFAULT NULL COMMENT '标签名称',
  `url` varchar(255) DEFAULT NULL COMMENT '标签图片地址',
  PRIMARY KEY (`id`)
