-- ----------------------------
-- Records of dc_label
-- ----------------------------
BEGIN;
COMMIT;

-- ----------------------------
-- Table structure for dc_library
-- ----------------------------
DROP TABLE IF EXISTS `dc_library`;
CREATE TABLE `dc_library` (
  `id` char(50) NOT NULL,
  `name` varchar(128) DEFAULT NULL COMMENT '名称',
  `share_role` enum('user','register','all') DEFAULT 'user' COMMENT '查看权限/成员开放、注册用户、完全开放',
  `share_password` varchar(255) DEFAULT NULL COMMENT '分享密码',
  `share` tinyint(1) DEFAULT '0' COMMENT '分享/不分享，分享',
  `share_validity_type` enum('PERPETUAL','ONE_DAY','SEVEN_DAY','THIRTY_DAY') DEFAULT NULL COMMENT '分享有效期',
  `share_end_time` datetime DEFAULT NULL COMMENT '分享结束时间',
  `share_link` varchar(255) DEFAULT NULL COMMENT '分享的文档链接,二维码可通过链接生成即可',
  `share_key` varchar(64) DEFAULT NULL COMMENT '分享key',
  `type` enum('knowledge','directory','document_html','document_xlsx','document_map','document_flow','document_unrecognized','document_upload') DEFAULT 'knowledge' COMMENT '类型\\知识库、目录、文本文档、表格文档、脑图文档、流程文档。',
  `parent_id` char(50) DEFAULT '0' COMMENT '上级ID',
  `size` double(11,4) DEFAULT '0.0000' COMMENT '文档大小',
  `bucket_name` varchar(255) DEFAULT NULL COMMENT '桐名称',
  `file_path` text COMMENT '文件存储路径',
  `create_by` varchar(50) DEFAULT NULL COMMENT '创建人名称',
  `create_by_id` char(50) DEFAULT NULL COMMENT '创建者ID',
  `create_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_by` varchar(50) DEFAULT NULL COMMENT '修改人',
  `update_time` datetime DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  `del_flag` tinyint(1) DEFAULT '0' COMMENT '是否删除 0未删除  1已删除',
  `description` varchar(255) DEFAULT NULL COMMENT '描述',
  `remark` varchar(255) DEFAULT NULL COMMENT '备注',
  `tenant_id` char(50) DEFAULT NULL COMMENT '租户ID',
  `sub_json` json DEFAULT NULL COMMENT '子集目录的json',
  `order_id` int(11) DEFAULT '0' COMMENT '排序字段',
  `editing_by` char(50) DEFAULT NULL COMMENT '该文档此时正在被哪个用户编辑,没有则为null',
  `knowledge_id` char(50) DEFAULT NULL COMMENT '知识库id',
  `color` longtext COMMENT '知识库颜色',
  `read_notify` tinyint(1) DEFAULT '1' COMMENT '自动发送查看提醒开关',
  `label` json DEFAULT NULL COMMENT '标签',
  `help` tinyint(255) DEFAULT NULL COMMENT '是否是帮助',
  `searchable` tinyint(1) DEFAULT '1' COMMENT '是否允许搜索 0-否，1-是',
  `commentable` tinyint(1) DEFAULT '1' COMMENT '是否可评论 0-否，1-是',
  `other_json` varchar(255) DEFAULT NULL COMMENT '前端用于存储其他字段(例如:脑图需要一个type类型存储）',
  `name_suffix` varchar(50) DEFAULT NULL,
  PRIMARY KEY (`id`) USING BTREE,
  KEY `idx_knowledge_id` (`knowledge_id`) USING BTREE,
  KEY `idx_parent_id` (`parent_id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT='知识库';

-- ----------------------------
-- Records of dc_library
-- ----------------------------
BEGIN;
COMMIT;

-- ----------------------------
-- Table structure for dc_library_authority
-- ----------------------------
DROP TABLE IF EXISTS `dc_library_authority`;
CREATE TABLE `dc_library_authority` (
  `id` char(50) NOT NULL,
  `user_id` char(50) DEFAULT NULL COMMENT '用户id（不是具体用户时为空）',
  `member_scope` enum('registerAll','user') DEFAULT NULL COMMENT '用户范围：所有企业成员、用户',
  `authority` enum('read','write') DEFAULT NULL COMMENT '权限：查看、编辑,',
  `dc_library_id` char(50) DEFAULT NULL COMMENT '知识库的ID值',
  `create_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_time` datetime DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  `del_flag` tinyint(1) DEFAULT '0' COMMENT '是否删除 0未删除  1已删除',
  `remark` varchar(255) DEFAULT NULL COMMENT '备注',
  `tenant_id` char(50) DEFAULT NULL COMMENT '租户ID',
  `create_by` varchar(255) DEFAULT NULL COMMENT '创建人名称',
  `update_by` varchar(50) DEFAULT NULL COMMENT '修改人',
  `create_by_id` char(50) DEFAULT NULL COMMENT '创建者ID',
  PRIMARY KEY (`id`) USING BTREE,
  KEY `idx_dc_library_id` (`dc_library_id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT='知识库-权限';

-- ----------------------------
-- Records of dc_library_authority
-- ----------------------------
BEGIN;
COMMIT;

